INSERT INTO `blog_details` VALUES (3,6,'heading 1','this is heading 1','2021-06-11','2021-06-11 16:29:04'),(4,6,'heading 2','this is heading 2','2021-06-11','2021-06-11 16:29:04'),(5,7,'Kokia Cookei','Πρόκειται για ένα σπάνιο, κατακόκκινο λουλούδι του οποίου το σχήμα θυμίζει λίγο τα αυτιά του Cocker Spaniel, και το οποίο συναντήθηκε πρώτη φορά το 1860 στο νησί Moloka\'i της Χαβάης. Ένας από τους παράγοντες που καθιστούν αυτό το άνθος τόσο σπάνιο και δυσεύρετο είναι το γεγονός ότι μπορούσε να εντοπιστεί μόνο σε τρία δέντρα, ενώ κατά τη δεκαετία του 1950 θεωρήθηκε εξαφανισμένο είδος. Παρόλα αυτά, βρέθηκε ξανά κατά τη δεκαετία του 1970. Τότε, οι ντόπιοι σκέφτηκαν πως θα ήταν καλή ιδέα να κόψουν ένα κλωνάρι και να το μπολιάσουν σε 23 δέντρα Kokia kauaiensis, ένα παρόμοιο και επίσης υπό εξαφάνιση είδος. Αυτό αποδείχτηκε μια πραγματικά καλή και έξυπνη ιδέα, καθώς το 1978 το τελευταίο δέντρο Kokia Cookei κάηκε σε μια πυρκαγιά! Παραλίγο…','2021-06-12','2021-06-12 07:20:53'),(6,7,'Corpse Flower','Μην το μπερδέψετε με την Corpse Bride… Το Amorphophallus titanium – όπως είναι η επίσημη ονομασία του – έχει αποκτήσει το παρατσούκλι «πτώμα» καθώς αναδύει μια καταπληκτική (λέμε τώρα…) μυρωδιά, που θυμίζει αυτή του σάπιου κρέατος! Αυτό φυσικά συμβαίνει για να προσελκύσει έντομα – επικονιαστές, οι οποίοι είναι απαραίτητοι για τη γονιμοποίησή του. Στα ινδονησιακά ονομάζεται bunga bangkai και συναντάται αποκλειστικά στα τροπικά δάση στη Σουμάτρα της Ινδονησίας. Θεωρείται ένα από τα σπανιότερα φυτά και εκείνο με τη μεγαλύτερη ταξιανθία (χωρίς κλαδιά) στο κόσμο, με ύψος που ξεπερνά τα 3 μέτρα! Η σπάθη του ιδιαίτερου άνθους του ανοίγει το απόγευμα και παραμένει ανοιχτή όλη τη νύχτα… Παρ’ όλες τις ανατριχιαστικές λεπτομέρειες που το συνοδεύουν, πρέπει να ομολογήσουμε πως η όψη του είναι άκρως εντυπωσιακή και επιβλητική!','2021-06-12','2021-06-12 07:20:53'),(7,7,'Chocolate Cosmos','Αυτό το υπέροχο βαθύ κόκκινο – κι όχι καφέ – άνθος κατάγεται από το Μεξικό. Ενώ αρχικά θεωρήθηκε εξαφανισμένο στη φύση, πρόσφατες έρευνες βρήκαν καταγραφές του άνθους  από το 1986 και έπειτα. Ίσως το συναντήσετε σε δάση του Μεξικού και σε υψόμετρο 1,800 – 2,450 μέτρων. Ο λόγος που το Cosmos atrosanguineus πήρε τον χαρακτηρισμό Chocolate Cosmos είναι η υπέροχη ευωδιά σοκολάτας ή βανίλιας που αναδύει! Γιαμ! Δεν θα ήταν τέλειο αν μπορούσατε να στείλετε λουλούδια στους αγαπημένους σας που να μυρίζουν σοκολάτα; Φυσικά το συγκεκριμένο θα ήταν δύσκολο να βρεθεί, όμως λύσεις πάντα υπάρχουν…','2021-06-12','2021-06-12 07:20:53'),(8,7,'Jade Vine','H κληματαριά Strongylodon macrobotrys συναντάται στα τροπικά δάση των Φιλιππίνων, ενώ η εμφάνισή της πραγματικά εντυπωσιάζει! Τα μυτερά άνθη της έχουν τις αποχρώσεις του πετρόλ, του μπλε ή του πράσινου της μέντας και πραγματικά προσφέρουν ένα πανέμορφο θέαμα! Δυστυχώς, τείνει να εξαφανιστεί καθώς το φυσικό της περιβάλλον καταστρέφεται μέρα με τη μέρα. Αυτό όμως που κάνει τη Jade Vine τόσο αξιοπερίεργη είναι πως οι επικονιαστές, που χρειάζονται για τη γονιμοποίησή της, δεν είναι άλλοι από τις… νυχτερίδες!!! Εκείνες κρέμονται ανάποδα – όπως συνηθίζουν άλλωστε να κρέμονται από παντού – για να πιούν το νέκταρ των ανθέων της κι έτσι τη γονιμοποιούν. Αν αυτό δεν είναι σενάριο επιστημονικής φαντασίας, τότε τι είναι;','2021-06-12','2021-06-12 07:20:53'),(9,7,'Stinking Corpse Lily','To Rafflesia arnoldii αποτελεί ένα από τρία εθνικά άνθη της Ινδονησίας, ενώ όπως και το ξαδελφάκι του Amorphophallus titanium (Corpse Flower) αναδύει κι αυτό μια “υπέροχη” μυρωδιά όταν ανθίζει, παρόμοια με αυτή της σάρκας που αποσυντίθεται! Εκτός από σπάνιο θεωρείται και το μεγαλύτερο λουλούδι στο κόσμο έως τώρα. Η διάμετρός του αγγίζει το ένα μέτρο. Αντίθετα βέβαια με το Corpse Flower, αυτό δεν διαθέτει ορατές ρίζες, βλαστούς ή φύλλα, ούτε όμως και την ουσία χλωροφύλλη. Η εμφάνισή του παραμένει βέβαια ιδιαίτερα εντυπωσιακή, με τεράστια πέταλα στις αποχρώσεις του σκούρου κόκκινου και του πορτοκαλί, γεμάτα με βούλες. Όμορφο να το βλέπεις, από μια απόσταση όμως!','2021-06-12','2021-06-12 07:20:53'),(10,7,'Western Underground Orchid','Η επίσημη ονομασία αυτού του “ντροπαλού” άνθους είναι: Rhizanthella Gardneri. Όπως προδίδει το προσωνύμιό του, αν και είναι πολύ όμορφο, περνάει όλη του τη ζωή κάτω από το έδαφος χωρίς να βλέπει πότε το φώς του ηλίου. Βρίσκεται στη νοτιοδυτική και δυτική Αυστραλία, με πέταλα που έχουν μια ροζ-κρεμ απόχρωση. Δυστυχώς, σπάνια το συναντά κανείς ενώ και αυτό θεωρείται είδος υπό εξαφάνιση. Αν πότε το δείτε κατά τύχη, μην ξεχάσετε να το βγάλετε πολλές φωτογραφίες! \r\n\r\nΜπορεί να μην επιλέγατε κάποιο από τα παραπάνω άνθη για να στείλετε λουλούδια σε ένα αγαπημένο σας πρόσωπο, όμως σίγουρα έχουν εξαιρετικό ενδιαφέρον και αποδεικνύουν πόσο πραγματικά μαγευτικός είναι ο κόσμος των λουλουδιών. Η φύση γύρω μας κρύβει μυστικά και “περίεργα” χαρακτηριστικά που αξίζει να τα ανακαλύπτουμε!','2021-06-12','2021-06-12 07:20:53'),(11,11,'asd','asd','2021-06-12','2021-06-12 13:37:11'),(12,11,'asd','asd','2021-06-12','2021-06-12 13:37:11'),(13,12,NULL,'Πρόσφατα μάλιστα, μια μελέτη από την Αμερικανική Εταιρεία Επιστήμης της Κηπουρικής έδειξε πως τα άνθη και τα φυτά δεν ανεβάζουν απλά τη διάθεση των ασθενών, αλλά λειτουργούν πρακτικά ως κομμάτι της θεραπείας τους! Κάποιοι από τους 90 ασθενείς που έλαβαν μέρος στη διεξαγωγή της έρευνας διέμειναν σε δωμάτια τα οποία είχαν φυτά και λουλούδια, ενώ οι υπόλοιποι έμειναν σε δωμάτια τα οποία δεν είχαν καθόλου φυτά. \r\nΌσοι πέρασαν χρόνο σε περιβάλλοντα με άνθη παρουσίασαν λιγότερο πόνο, μειωμένα επίπεδα κόπωσης, χαμηλότερο καρδιακό ρυθμό και χαμηλότερη αρτηριακή πίεση. Αντίθετα, οι υπόλοιποι ασθενείς δεν είχαν κανένα από τα παραπάνω οφέλη.','2021-06-12','2021-06-12 14:05:48'),(14,12,NULL,'Όμως η θετική επίδραση δεν σταμάτησε εκεί. Στους ασθενείς που ήρθαν σε επαφή με λουλούδια και φυτά παρατηρήθηκε μείωση στα επίπεδα άγχους, ενώ υπήρξε επίσης αύξηση στα θετικά συναισθήματα και στο αίσθημα της ικανοποίησης. Γεγονός που επαληθεύεται και από μια ακόμη μελέτη που βρίσκεται στο ακαδημαϊκό περιοδικό Complementary Therapies In Medicine. Στα πλαίσια αυτής, τοποθετήθηκαν βάζα με φρέσκα τριαντάφυλλα στα δωμάτια των φοιτητριών ενός πανεπιστημίου, κάτι το οποίο είχε ως αποτέλεσμα να νιώθουν μεγαλύτερη ηρεμία και να μειωθεί το άγχος τους. Συμπεραίνουμε λοιπόν, πως η αποστολή λουλουδιών δεν αποτελεί απλά μια όμορφη χειρονομία, αλλά μια πρακτική βοήθεια σε ασθενείς ή σε συνανθρώπους μας που διανύουν μια αγχωτική περίοδο.','2021-06-12','2021-06-12 14:05:48'),(15,12,NULL,'Ως τώρα θεωρούσαμε τα άνθη στολίδια της φύσης και τα θαυμάζαμε για την ομορφιά τους… Θα μπορούσαμε όμως να πούμε πως είναι ίσως ένα ακόμη «φάρμακο» από το οποίο όλοι μπορούμε να επωφεληθούμε, ειδικά τη συγκεκριμένη χρονική στιγμή που βρισκόμαστε στη μέση μιας τόσο ιδιαίτερης κατάστασης. Αν έως τώρα δεν βρίσκατε έναν καλό λόγο για να στείλετε λουλούδια, μάλλον ήρθε η ώρα να αναθεωρήσετε. Δεν χρειάζεται να περιμένετε κάποια επέτειο ή γιορτή… Η αποστολή λουλουδιών λειτουργεί ευεργετικά σε κάθε περίσταση. Προσφέρετε ένα όμορφο μπουκέτο σε κάποιο αγαπημένο πρόσωπο που έχει ανάγκη από λίγη τόνωση ή ακόμη και στον εαυτό σας! Όλοι χρειαζόμαστε μια τόσο όμορφη ώθηση στην καθημερινότητά μας.','2021-06-12','2021-06-12 14:06:27'),(16,13,NULL,'Το πανάκριβο μπουκέτο στο οποίο αναφερόμαστε αποτελεί δημιουργία των καλλιτεχνών της μεγαλύτερης εταιρείας διατηρημένων λουλουδιών του Ηνωμένου Βασιλείου, Endura Roses και ονομάζεται Cullinal. Το όνομά του είναι εμπνευσμένο από το Cullinal Diamond, ένα πολύτιμο πετράδι που κοσμεί το στέμμα της Βασίλισσας της Αγγλίας.','2021-06-12','2021-06-12 14:08:17'),(17,13,NULL,'Η ανθοδέσμη αποτελείται από 100 διατηρημένα άνθη. Ανάμεσά τους θα βρείτε μια μαύρη ορτανσία καθώς και μια πλειάδα από τριαντάφυλλά η οποία συμπεριλαμβάνει 6 grandeur τριαντάφυλλα με επικάλυψη χρυσού 24 καρατίων, ένα Grande τριαντάφυλλο από τα ηφαιστειακά εδάφη του Καγιάμπ στο Εκουαδόρ, τρία χειροποίητα τριαντάφυλλα σε σχήμα καρδίας αλλά και ένα μεγάλο, ιδιαίτερα σπάνιο Juliette τριαντάφυλλο με διπλά πέταλα. Κάτι απλό, λιτό κι απέριττο, ξέρετε...','2021-06-12','2021-06-12 14:08:17'),(18,13,NULL,'Για να ολοκληρωθεί η extravaganza, η ανθοδέσμη είναι πασπαλισμένη με... αστερόσκονη! Οκ, όχι ακριβώς με αστερόσκονη, αλλά με ένα ειδικό σπρέι φτιαγμένο από πολύπλευρα θρυμματισμένα διαμάντια. Στη μέση του μπουκέτου δεσπόζει ένας Mon Cherie γυάλινος σκαλιστός θόλος για άνθη που κρύβει 2 διαμάντια Cullinal ένα των 0.5 καρατίων και ένα  0.3 καρατίων... Μόνο! Εννοείται βέβαια πως μια τέτοια ανθοδέσμη δεν θα μπορούσε να είναι τυλιγμένη με χαρτί ή κάτι τέτοιο. Φανταζόμαστε λοιπόν πως και η παράδοσή της θα γίνεται με έναν εξίσου μεγαλειώδη τρόπο.','2021-06-12','2021-06-12 14:08:17'),(19,13,NULL,'Μάλιστα, το εν λόγω μπουκέτο θεωρείται το ακριβότερο στο κόσμο αυτή τη στιγμή... Ένα πραγματικά πολύτιμο «Σ’ αγαπώ» θα έλεγε κανείς! Φυσικά, ο σχεδιαστής Oliver Hibbert δηλώνει πως η ανθοδέσμη διατηρείται τέσσερα με πέντε χρόνια, δικαιολογώντας το αστρονομικό πόσο που κοστίζει, ενώ λέει πως αν μπει σε γυάλινη θήκη μπορεί να διατηρηθεί για πάντα!','2021-06-12','2021-06-12 14:09:12'),(20,13,NULL,'Τώρα βέβαια, το να στείλετε λουλούδια που να αγγίζουν το επίπεδο αυτής της ανθοδέσμης ίσως να μην είναι δυνατό ή απαραίτητο, για να είμαστε ειλικρινείς. Θα μπορούσατε όμως να εμπνευστείτε από αυτή την πολυτελή ιδέα και να επιλέξετε κάποιο forever rose σε γυάλινο θολό, που επίσης διαρκεί για χρόνια... Αλά Beauty & The Beast!','2021-06-12','2021-06-12 14:09:23'),(21,13,NULL,'Το μόνο σίγουρο είναι πως ό, τι κι αν επιλέξετε ένα μεγάλο χαμόγελο θα ζωγραφιστεί στα χείλη του ατόμου που θα το παραλάβει. Μπορεί μερικές ανθοδέσμες, όπως η Cullinal, να είναι πιο ακριβές και υπερβολικές από άλλες, όμως όλες τους είναι εξίσου πολύτιμες όταν η αποστολή τους προέρχεται από τη καρδιά. Το να στείλετε λουλούδια δεν πρέπει να αποτελεί μια αγχωτική διαδικασία, αλλά μια πράξη γεμάτη συναισθήματα και όμορφες σκέψεις. Κάποιες φορές, ακόμη κι ένα τριαντάφυλλο αρκεί!','2021-06-12','2021-06-12 14:09:31'),(22,14,'The Most Expensive Flower Bouquet in the World','There is no better and more romantic way to say \"I love you\" than sending flowers. A bouquet is the ultimate sign of feelings of affection and devotion. All the more so when that bouquet costs around £20,000!','2021-09-25','2021-09-25 04:11:31'),(23,14,NULL,'The very expensive bouquet we are referring to is a creation of the artists at the UK\'s largest preserved flower company, Endura Roses and is called Cullinal. Its name is inspired by the Cullinal Diamond, a precious gemstone that adorns the Queen of England\'s crown.','2021-09-25','2021-09-25 04:12:58'),(24,14,NULL,'The bouquet consists of 100 preserved flowers. Among them you will find a black hydrangea as well as a multitude of roses which includes 6 grandeur roses coated in 24 carat gold, a Grande rose from the volcanic lands of the Cayab in Ecuador, three handmade heart-shaped roses and a large, very rare Juliette rose with double petals. Something plain and simple, you know...','2021-09-25','2021-09-25 04:15:35'),(25,14,NULL,'To complete the extravaganza, the bouquet is sprinkled with... stardust! Okay, not exactly stardust, but a special spray made of multi-faceted crushed diamonds. The middle of the bouquet is dominated by a Mon Cherie glass carved flower dome hiding 2 Cullinal diamonds one 0.5 carat and one 0.3 carat... Only! It goes without saying, of course, that such a bouquet could not be wrapped in paper or anything like that. So we imagine that its delivery will be done in an equally grandiose manner.','2021-09-25','2021-09-25 04:15:44'),(26,14,NULL,'In fact, the bouquet in question is considered the most expensive one in the world at the moment... A truly precious \"I love you\" one might say! Of course, designer Oliver Hibbert states that the bouquet will last four to five years, justifying the astronomical amount it costs, and says that if put in a glass case it can last forever!','2021-09-25','2021-09-25 04:15:53'),(27,14,NULL,'Now granted, sending flowers that reach the level of this bouquet may not be possible or necessary, to be honest. But you could get inspired by this luxurious idea and choose a forever rose in a glass dome that also lasts for years... Ala Beauty & The Beast!','2021-09-25','2021-09-25 04:16:05'),(28,14,NULL,'One thing is for sure, whatever you choose a big smile will be painted on the lips of the person who receives it. Some bouquets, like the Cullinal, may be more expensive and extravagant than others, but all of them are just as precious when their offering comes from the heart. Sending flowers should not be a stressful process, but an act full of emotions and beautiful thoughts. Sometimes, even a single rose is enough!','2021-09-25','2021-09-25 04:16:30'),(29,14,'How Flowers Benefit Our Daily Life and Health!','It is well known and commonly accepted that flowers make our lives more beautiful, lift our spirits and add a touch of joy to any space. Usually, the act of sending flowers is intertwined with romantic moments, important events, but also with acts of kindness to loved ones who may be going through difficult times. Many times, we send flowers to friends or relatives who are in the hospital or maternity ward, wanting to make them feel better. We feel that the beautiful colors and fragrances they have will decorate the environment around them, giving them a feeling of euphoria and relief. It seems that science agrees with us...','2021-09-25','2021-09-25 04:17:01'),(30,14,NULL,'In fact, a recent study by the American Society for Horticultural Science has shown that flowers and plants not only lift the spirits of patients, but practically act as part of their treatment! Some of the 90 patients who took part in the study stayed in rooms that had plants and flowers, while the rest stayed in rooms that had no plants at all. Those who spent time in environments with flowers experienced less pain, reduced levels of fatigue, lower heart rate and lower blood pressure. In contrast, the other patients had none of these benefits.','2021-09-25','2021-09-25 04:17:14'),(31,14,NULL,'But the positive effect did not stop there. Patients who came into contact with flowers and plants experienced a reduction in stress levels, while there was also an increase in positive emotions and feelings of contentment. A fact that is verified by another study found in the academic magazine Complementary Therapies In Medicine. As part of this, vases of fresh roses were placed in the rooms of female students at a university, which resulted in them feeling calmer and less nervous. We conclude, therefore, that sending flowers is not just a beautiful gesture, but a form of practical help to patients or to our fellow human beings who are going through a stressful period.','2021-09-25','2021-09-25 04:17:36'),(32,14,NULL,'Up until now we have considered flowers to be nature\'s jewels and admired them for their beauty... But we could say that they are perhaps another \'medicine\' from which we can all benefit, especially at this particular time when we are in the midst of such a unique situation. If you haven\'t found a good reason to send flowers so far, it\'s probably time to reconsider. You don\'t have to wait for an anniversary or celebration... Sending flowers works beneficially in any occasion. Offer a beautiful bouquet to a loved one in need of a little boost or even to yourself! We all need a beautiful pick-me-up like this in our daily lives.','2021-09-25','2021-09-25 04:17:44'),(33,14,'6 of the rarest and strangest flowers in the world','Flowers are perhaps the most beautiful gift one can give or receive! People send flowers to their loved ones on a multitude of occasions such as anniversaries, birthdays, professional successes and more. A lovely bouquet can bring smiles to the recipient generously and brighten their mood or day. Of course, all flowers are equally beautiful, and different types represent different messages and personalities... However, there are some specific flowers of exceptional rarity that are not often found in nature! Gorgeous or particularly strange, each one has its own special charm. If you want to get to know them too, keep reading!','2021-09-25','2021-09-25 04:17:56'),(34,14,'Kokia Cookei','This is a rare, bright red flower whose shape slightly resembles the ears of the Cocker Spaniel, and which was first encountered in 1860 on the island of Moloka\'i, Hawaii. One of the factors that make this flower so rare and hard to find is the fact that it could only be found on three trees, and in the 1950s it was considered an extinct species. However, it was found again in the 1970s. At that time, locals thought it would be a good idea to cut a twig and graft it onto 23 trees of Kokia kauaiensis, a similar and also endangered species. This turned out to be a really great and smart idea, because in 1978 the last Kokia Cookei tree was burnt down in a fire! A very close call...','2021-09-25','2021-09-25 04:18:27'),(35,14,'Corpse Flower','Not to be confused with the Corpse Bride... Amorphophallus titanium – as its official name is – has acquired the nickname \"corpse\" as it emits an amazing (so to speak...) smell, reminiscent of that of rotting meat! This is of course to attract insects - pollinators, which are necessary for its pollination. In Indonesian it is called bunga bangkai and is found exclusively in the rainforests in Sumatra, Indonesia. It is considered one of the rarest plants and the one with the largest inflorescence (without branches) in the world, with a height of more than 3 meters! The spike of its distinctive flower opens in the afternoon and stays open all night... Despite all the creepy details that accompany it, we must admit that its appearance is extremely impressive and majestic!','2021-09-25','2021-09-25 04:18:41'),(36,14,'Chocolate Cosmos','This lovely deep red – not brown – flower originates from Mexico. While originally thought to be extinct in the wild, recent research has found records of the flower from 1986 onwards. You might find it in Mexican forests and at altitudes of 1,800 - 2,450 meters. The reason Cosmos atrosanguineus was given the label Chocolate Cosmos is the wonderful chocolate or vanilla scent it emits! Yum! Wouldn\'t it be great if you could send flowers to your loved ones that smell like chocolate? Of course, this one would be hard to find, but there are always alternatives...','2021-09-25','2021-09-25 04:18:55'),(37,14,'Jade Vine','The Strongylodon macrobotrys vine is found in the rainforests of the Philippines, and its appearance is truly stunning! Its pointed flowers are in shades of teal, blue or mint green and really do make a beautiful sight! Unfortunately, it is becoming extinct as its natural habitat is being destroyed day by day. But what makes the Jade Vine so remarkable is that the pollinators, needed for its pollination, are none other than... bats!!! They hang upside down - as they tend to do everywhere - to drink the nectar of its flowers and thus pollinate it. If this is not a science fiction scenario, then what is it?','2021-09-25','2021-09-25 04:19:11'),(38,14,'Stinking Corpse Lily','Rafflesia arnoldii is one of three national flowers of Indonesia, and like its cousin Amorphophallus titanium (Corpse Flower), it too emits a \"wonderful\" smell when it blooms, similar to that of decomposing flesh! Besides being rare, it is also considered the largest flower in the world so far. Its diameter reaches one meter. However, unlike the Corpse Flower, this one has no visible roots, stems or leaves, nor does it contain the chlorophyll substance. Its appearance though remains very impressive, with huge petals in shades of dark red and orange, full of dots. Beautiful to look at, but from a distance!','2021-09-25','2021-09-25 04:19:23'),(39,14,'Western Underground Orchid','The official name of this \"shy\" flower is Rhizanthella Gardneri. As its nickname suggests, although it is very beautiful, it spends its entire life underground, never seeing the light of day. It is found in southwest and western Australia, with petals that have a pinkish-cream hue. Unfortunately, it is rarely seen and is also considered an endangered species. If you ever see it by chance, don\'t forget to take lots of pictures!','2021-09-25','2021-09-25 04:19:42'),(40,14,NULL,'You may not have chosen any of the above blossoms to send flowers to a loved one, but they are certainly of great interest and prove how truly enchanting the world of flowers is. Nature around us hides secrets and \"strange\" features that are worth discovering!','2021-09-25','2021-09-25 04:19:54');
