INSERT INTO `blogs` VALUES (7,'6 από τα σπανιότερα και πιο παράξενα  άνθη στο κόσμο','6-apo-ta-spaniotera-kai-pio-paraxena-anthh-sto-kosmo','Τα άνθη αποτελούν ίσως το ομορφότερο δώρο που μπορεί κάποιος να προσφέρει ή να λάβει! Οι άνθρωποι στέλνουν λουλούδια στους αγαπημένους τους για μια πλειάδα περιστάσεων όπως επετείους, γενέθλια, επαγγελματικές επιτυχίες και πολλά ακόμη. Ένα υπέροχο μπουκέτο μπορεί να χαρίσει χαμόγελα στον παραλήπτη απλόχερα και να φτιάξει τη διάθεση ή την ημέρα του. Φυσικά, όλα τα λουλούδια είναι εξίσου όμορφα, ενώ διαφορετικά είδη αντιπροσωπεύουν διαφορετικά μηνύματα και προσωπικότητες… Παρόλα αυτά, υπάρχουν κάποια συγκεκριμένα άνθη εξαιρετικής σπανιότητας, τα οποία δεν συναντώνται συχνά στη φύση! Πανέμορφα ή ιδιαίτερα περίεργα, το κάθε ένα έχει τη δική του ξεχωριστή γοητεία. Αν θέλετε κι εσείς να τα γνωρίσετε, συνεχίστε την ανάγνωση!','64541.jpeg','1','2021-06-12 10:20:53','2021-06-13 08:11:34'),(12,'Πως τα Λουλούδια Ωφελούν την Καθημερινή Ζωή και την Υγεία μας!','pws-ta-loyloydia-wfeloyn-thn-kathhmerinh-zwh-kai-thn-ygeia-mas','Είναι γνωστό και κοινώς αποδεκτό πως τα λουλούδια ομορφαίνουν τη ζωή μας, φτιάχνουν την διάθεσή μας και προσδίδουν μια νότα χαράς σε κάθε χώρο. Συνήθως, η πράξη της αποστολής λουλουδιών είναι συνυφασμένη με ρομαντικές στιγμές, σημαντικά γεγονότα, αλλά και με κινήσεις ευγένειας προς αγαπημένα πρόσωπα που ίσως περνούν δύσκολες στιγμές. Πολλές φορές, στέλνουμε λουλούδια σε φίλους ή συγγενείς που βρίσκονται στο νοσοκομείο ή στο μαιευτήριο, θέλοντας να τους κάνουμε να νιώσουν καλύτερα. Θεωρούμε πως τα υπέροχα χρώματα κι αρώματα που έχουν θα στολίσουν το περιβάλλον γύρω τους, προσφέροντάς τους ένα αίσθημα ευφορίας και ανακούφισης. Απ’ ότι φαίνεται η επιστήμη συμφωνεί μαζί μας…','87888.jpeg','1','2021-06-12 17:05:48','2021-06-12 14:05:48'),(13,'Η πιο Ακριβή Ανθοδέσμη στο Κόσμο','h-pio-akribh-anthodesmh-sto-kosmo','Δεν υπάρχει καλύτερος και πιο ρομαντικός τρόπος για να πει κάποιος «Σ’ αγαπώ» από το να στείλει λουλούδια. Μια ανθοδέσμη αποτελεί την απόλυτη ένδειξη συναισθημάτων στοργής και αφοσίωσης. Πόσο μάλλον όταν αυτή η ανθοδέσμη κοστίζει περίπου 20.000 Αγγλικές λίρες!','43436.jpeg','1','2021-06-12 17:08:17','2021-06-12 14:08:17'),(14,'The Most Expensive Flower Bouquet in the World','the-most-expensive-flower-bouquet-in-the-world','','44406.jpeg','1','2021-09-25 07:11:31','2021-09-25 04:14:46'),(15,'Πως να διατηρούμε τα λουλούδια σε βάζο για περισσότερες ημερες','pws-na-diathroyme-ta-loyloydia-se-bazo-gia-perissoteres-hmeres','Πώς μπορούμε να διατηρήσουμε τα λουλούδια σε βάζο για περισσότερες μέρες; Όλα ξεκινάνε από το κόψιμο. Οι καλύτερες ώρες για να κόψουμε τα λουλούδια που θα στολίσουμε σε βάζο είναι νωρίς το πρωί. Με αυτό τον τρόπο εξασφαλίσουμε ότι τα λουλούδια μας είναι πιο δροσερά και γεμάτα άρωμα. Τα κόβουμε λοξά, σε απόσταση περίπου δύο εκατοστών πάνω από τη βάση του ανθοφόρου βλαστού, για να μπορούν να απορροφήσουν περισσότερο νερό. Είναι σημαντικό να κόβουμε τα λουλούδια μέσα σε λεκάνη με νερό, ώστε τα λουλούδια μας να έρχονται σε επαφή με τον αέρα όσο το δυνατόν λιγότερο. Αφαιρούμε τα κάτω φύλλα των ανθοφόρων βλαστών, καθώς και μαραμένα λουλούδια για να μην πέσουν μέσα στο νερό και σαπίσουν. Καθαρίζουμε το βάζο μας χρησιμοποιώντας λίγη χλωρίνη για απολύμανση από μύκητες και μικρόβια. Προσέχουμε να μην τοποθετούμε στο βάζο περισσότερα λουλούδια από όσα χωράει, γιατί με αυτό τον τρόπο ταλαιπωρούμε τους βλαστούς και τους μίσχους των φυτών. Αποφεύγουμε μεγάλη ποσότητα νερού στο βάζο για συγκεκριμένα λουλούδια, όπως οι ζέρμπερες που έχουν μικρά τριχίδια επάνω στο βλαστό τους, καθώς σαπίζουν γρήγορα. Αλλάζουμε το νερό κάθε 3 μέρες και κόβουμε ξανά τα λουλούδια ένα εκατοστό πάνω από την προηγούμενη τομή. Τοποθετούμε το βάζο με τα λουλούδια σε φωτεινό μέρος και φροντίζουμε να μην τα χτυπάει απευθείας ο ήλιος. Διατηρούμε το βάζο μακριά από καλοριφέρ και τζάκι καθώς και από ρεύματα αέρα, γιατί ταλαιπωρούν τα λουλούδια μας και μαραίνονται πιο γρήγορα.','36266.jpeg','1','2022-01-23 16:25:33','2022-01-23 14:25:33'),(16,'ΧΡΗΣΙΜΕΣ ΣΥΜΒΟΥΛΕΣ ΓΙΑ ΤΑ ΛΟΥΛΟΥΔΙΑ ΠΟΥ ΘΑ  ΠΡΟΣΦΕΡΕΤΕ ΣΤΗ ΓΙΟΡΤΗ ΤΟΥ ΑΓ.ΒΑΛΕΝΤΙΝΟΥ','xrhsimes-symboyles-gia-ta-loyloydia-poy-tha-prosferete-sth-giorth-toy-agbalentinoy','1. ΒΕΒΑΙΩΘΕΙΤΕ ΟΤΙ ΕΙΝΑΙ ΦΡΕΣΚΑ....\r\n\r\nΔεν θα τους δίνατε σοκολάτες που έχουν περάσει την ημερομηνία πώλησης τους, γι\' αυτό μην κάνετε το ίδιο με τα άνθη σας. Εάν τα αγοράζετε αυτοπροσώπως, ελέγξτε ότι είναι εξαιρετικά φρέσκα, νιώθοντας απαλά το τμήμα του πετάλου που συναντά το στέλεχος. Όσο πιο σφιχτό είναι αυτό το μέρος, τόσο πιο φρέσκο ​​είναι το λουλούδι.\r\n\r\n2. … ΚΑΙ ΘΑ ΚΡΑΤΗΣΟΥΝ\r\n\r\nΕάν τα λουλούδια είναι σύμβολο της αγάπης σας, τι θα σκεφτείτε το ραντεβού σας αν έχουν πέσει μέχρι τις 15 Φεβρουαρίου; Για να τα βοηθήσετε να παραμείνουν αληθινά και μακράς διαρκείας, βεβαιωθείτε ότι τα στελέχη έχουν κοπεί με ένα κοφτερό μαχαίρι (όχι ψαλίδι!) και βυθίζονται σε φρέσκο, καθαρό νερό σε ένα καθαρό βάζο που τρίζει.\r\n\r\n3. ΤΟΛΜΗΣΤΕ ΝΑ ΕΙΣΤΕ ΔΙΑΦΟΡΕΤΙΚΟΙ\r\n\r\nΜπορεί να είναι το λουλούδι συνώνυμο της Ημέρας του Αγίου Βαλεντίνου, αλλά το να αρπάξεις ένα μάτσο κόκκινα τριαντάφυλλα δεν δείχνει ακριβώς πολλή σκέψη ή φαντασία. Προσπαθήστε να ανακαλύψετε τα αγαπημένα τους λουλούδια εκ των προτέρων (θα σας βοηθήσει να περιπλανηθείτε σε μερικά ανθοπωλεία). Σε αντίθετη περίπτωση, σκεφτείτε ένα αγαπημένο χρώμα ή άρωμα και ζητήστε από τον ανθοπώλη να σας βοηθήσει να επιλέξετε μια διάταξη που αντανακλά τον χαρακτήρα τους.\r\n\r\n4. ΚΑΝΤΕ ΤΗΣ ΝΑ ΧΑΜΟΓΕΛΑΣΕΙ… ΝΑ ΜΗΝ ΦΤΕΡΝΙΣΤΕΙ!\r\n\r\nΘέλετε να δώσετε τον πυρετό της αγάπης σας με την έννοια της Nina Simone, όχι τον πυρετό του χόρτου. Εάν το αντικείμενο της αγάπης σας είναι κάποιος που υποφέρει από αλλεργία, αποφύγετε τις μεθυστικές μυρωδιές, όπως υάκινθους, ζουμπούλια,νάρκισσους που μπορεί να τους κάνουν να φτερνίζονται και να ρέουν. Αντ \'αυτού, επιλέξτε λουλούδια όπως ορτανσία, τουλίπες, ίριδα τριαντάφυλλα.\r\n\r\n5. ΑKOMA KI AN ΔΕΝ ΠΡΟΛΑΒΑΙΝΕΤΕ......\r\n\r\n  Θέλετε να εκφράσετε την αγάπη σας μια τέτοια μέρα αλλά θα είστε στο γραφείο σχεδόν μέχρι το βράδυ.\r\nΚανένα πρόβλημα δεν υπάρχει!\r\nΠληκτρολογείτε www.ebloom.gr και δίνεται τη παραγγελία σας online.\r\nΑπό το γραφείο σας μπορείτε να διαλέξετε τα λουλούδια που σας αρέσουν και όχι από ένα αλλά από πολλά ανθοπωλεία.\r\nΗ παραγγελία σας θα πάει με την εγγύηση της E-bloom.','55669.jpeg','1','2022-02-02 11:21:13','2022-02-02 09:21:13');
