,1,'2021-10-21','2021-10-21'),(342,NULL,9,NULL,'Olive tree in ceramic pot',NULL,NULL,'','Olive tree in ceramic pot',NULL,'',35,'olive-tree-in-ceramic-pot','90420.JPG',1,28,1,'2021-10-21','2021-10-21'),(343,NULL,9,NULL,'Olive tree in ceramic pot big',NULL,NULL,'','Olive tree in ceramic pot big',NULL,'',45,'olive-tree-in-ceramic-pot-big','98700.JPG',1,28,1,'2021-10-21','2021-10-21'),(344,NULL,6,NULL,'Ορχιδέες σε γυάλινο κασπώ',NULL,NULL,'Σύνθεση με ορχιδέες σε διάφορα χρώματα. Μεγάλες ορχιδέες φυτεμένες σε μεγάλη γυάλα. Ένας όμορφος συνδυασμός λουλουδίων που έχουν μεγάλη διάρκεια ανθοφορίας.','Orchids in a glass pot',NULL,'Composition with orchids in different colors. Large orchids planted in a large bowl. A beautiful combination of flowers that have a long flowering period.',75,'orxidees-se-gyalino-kaspw','72238.JPG',1,28,1,'2021-10-21','2021-10-21'),(345,NULL,6,NULL,'Orchid in ceramic pot',NULL,NULL,'Μια υπέροχη ορχιδέα για την διακόσμηση του εσωτερικού χώρου. Με επιλογή στο χρώμα της, ανάλογα της περίστασης ή του χώρου που πρόκειται να κοσμήσει.','Orchid in ceramic pot',NULL,'A wonderful orchid for interior decoration. By choosing its color, depending on the occasion or the space it is going to decorate.',35,'orchid-in-ceramic-pot','7171.JPG',1,28,1,'2021-10-21','2022-04-06'),(346,NULL,6,NULL,'Ορχιδέες mini σε πήλινο κασπώ',NULL,NULL,'Σύνθεση με mini ορχιδέες σε διάφορα χρώματα. Ένας όμορφος συνδυασμός λουλουδίων που έχουν μεγάλη διάρκεια ανθοφορίας.','Mini orchids in a clay pot',NULL,'Composition with mini orchids in different colors. A beautiful combination of flowers that have a long flowering period.',50,'orxidees-mini-se-phlino-kaspw','10990.JPG',1,28,1,'2021-10-21','2021-10-21'),(349,NULL,8,NULL,'Sansevieria σε κασπώ',NULL,NULL,'Ένα πολυ μοντέρνο και minimal φυτό σε ιδιαίτερα κασπώ. Μπορεί να γίνει το δωρό που όλοι θα αγαπήσουν γιατι δεν χρειάζεται ιδιαίτερη φροντίδα.\r\n\r\nΈχει ελάχιστες ανάγκες τόσο στο πότισμα του όσο και στο φωτισμό του.','Sansevieria in ceramic pot',NULL,'A very modern and minimal plant in a special pot. It can be the gift that everyone will love because it does not need special care.\r\n\r\nIt has minimal needs for both its watering and its lighting.',30,'sansevieria-se-kaspw','56878.JPG',1,28,1,'2021-10-21','2021-10-21'),(350,NULL,8,NULL,'Bonsai Tree σε κεραμικό',NULL,NULL,'Ένα μεγάλο δέντρο που καλλιεργείται σε μικρό χώρο. Τα περισσότερα ειναι πολύ εύκολα στη συντήρηση τους. Χαρίστε ένα bonsai για τα εγκαίνια ένος νέου χώρου για τύχη, μιας και για τους Ιάπωνες θεωρείται μεγάλη τύχη.','Bonsai Tree in ceramic',NULL,'A large tree that is grown in a small space. Most are very easy to maintain. Give a bonsai for the opening of a new place for luck, since for the Japanese it is considered great luck.',30,'bonsai-tree-se-keramiko','48052.JPG',1,28,1,'2021-10-21','2021-10-21'),(351,NULL,6,NULL,'Orchid in ceramic pot (m)',NULL,NULL,'Μια υπέροχη ορχιδέα για την διακόσμηση του εσωτερικού χώρου. Με επιλογή στο χρώμα της, ανάλογα της περίστασης ή του χώρου που πρόκειται να κοσμήσει.','Orchid in ceramic pot (m)',NULL,'A wonderful orchid for interior decoration. By choosing its color, depending on the occasion or the space it is going to decorate.',28,'orchid-in-ceramic-pot-m','2191.JPG',1,28,1,'2021-10-22','2021-10-22'),(352,NULL,3,NULL,'ΜΠΟΥΚΕΤΟ','011',NULL,'ΛΕΥΚΟ & ΡΟΖ ΜΠΟΥΚΕΤΟ','BOUQUET',NULL,'WHITE & PINK BOUQUET',50,'mpoyketo','87460.jpg',1,51,1,'2021-10-22','2021-10-22'),(353,NULL,3,NULL,'ΜΠΟΥΚΕΤΟ','012',NULL,'ΜΠΟΥΚΕΤΟ ΤΟΥ ΑΓΡΟΥ','BOUQUET',NULL,'SEASONAL BOUQUET',40,'mpoyketo','15353.jpg',1,51,1,'2021-10-22','2021-10-22'),(354,NULL,3,NULL,'ΜΠΟΥΚΕΤΟ','013',NULL,'ΜΠΟΥΚΕΤΟ ΜΕ ΔΙΧΡΩΜΕΣ ΤΟΥΛΙΠΕΣ','BOUQUET',NULL,'BOUQUET WITH TWO COLORED TULIPS',40,'mpoyketo','15659.jpg',1,51,1,'2021-10-22','2021-10-22'),(355,NULL,3,NULL,'ΜΠΟΥΚΕΤΟ','014',NULL,'ΠΟΡΤΟΚΑΛΙ ΜΠΟΥΚΕΤΟ','BOUQUET',NULL,'BOUQUET WITH ORANGE ROSES',45,'mpoyketo','34710.jpg',1,51,1,'2021-10-22','2021-10-22'),(356,NULL,3,NULL,'ΜΠΟΥΚΕΤΟ','015',NULL,'ΜΠΟΥ