άκι. Ένα όμορφο και εντυπωσιακό δώρο που ταιριάζει σε κάθε περίσταση.','White orchid in a clay pot',NULL,'White Falainopsis orchid in a clay pot. A beautiful and impressive gift that suits every occasion.',30,'leykh-orxidea-se-phlino-glastraki','66834.jpg',1,86,1,'2021-11-29','2021-11-29'),(801,NULL,8,NULL,'Σπαθίφυλλο σε πήλινη γλάστρα','RG-1305',NULL,'Το σπαθίφυλλο είναι ένα φυτό εσωτερικού χώρου με μεγάλη αντοχή αρκεί να ποτίζεται επαρκώς.','Spathiphyllum in a clay pot',NULL,'Spathiphyllum is an indoor plant with great durability as long as it is adequately watered',25,'spathifyllo-se-phlinh-glastra','99473.jpg',1,86,1,'2021-11-29','2021-11-29'),(802,NULL,8,NULL,'Φυτό ανθούριο σε πήλινη γλάστρα','RG-1302',NULL,'Το ανθούριο είναι ένα φυτό εσωτερικού χώρου με χαρακτηριστικό κόκκινο άνθος που του προσδίδει ιδιαίτερη καλλωπιστική αξία.','Anthurium plant in a clay pot',NULL,'Anthurium is an indoor plant with a characteristic red flower that gives it a special ornamental value.',28,'fyto-anthoyrio-se-phlinh-glastra','13704.jpg',1,86,1,'2021-11-29','2022-03-03'),(803,NULL,8,NULL,'Φυτό ζάμια σε πήλινη γλάστρα','RG-1301',NULL,'Η ζάμια είναι ένα φυτό εσωτερικού χώρου πολύ ανθεκτικό και με ένα πλούσιο φύλλωμα. Απαιτεί ελάχιστη περιποίηση καθώς δεν χρειάζεται πολύ φως ή πότισμα. Πρέπει να τοποθετείται σε φωτεινά σημεία στο χώρο, χωρίς να την βλέπει άμεσα το φως του ηλίου.','Plant zamia in a clay pot',NULL,'Zamia is an indoor plant very durable and with a rich foliage. Requires minimal care as it does not need much light or watering. It should be placed in bright places in the space, without direct sunlight.',35,'fyto-zamia-se-phlinh-glastra','45267.jpg',1,86,1,'2021-11-29','2021-11-29'),(804,NULL,10,NULL,'Μπορντό τριαντάφυλλο σε τετράγωνη γυάλα','RG-1203',NULL,'Μπορντό αναλλοίωτο τριαντάφυλλο σε τετράγωνη γυάλα με ξύλινη βάση. Τα αναλλοίωτα τριαντάφυλλα ή FOREVER ROSES διατηρούν το χρώμα και την υφή τους για πολλά χρόνια. Πρόκειται για αληθινά τριαντάφυλλα τα οποία μετά από συγκεκριμένη επεξεργασία έχουν την όψη ενός αληθινού λουλουδιού.','Bordeaux rose in a square bowl',NULL,'Unchanged burgundy rose in a square bowl with a wooden base. Unchanged roses or FOREVER ROSES retain their color and texture for many years. These are real roses which after a certain treatment have the look of a real flower.',25,'mpornto-triantafyllo-se-tetragwnh-gyala','33904.jpg',0,86,1,'2021-11-29','2022-03-03'),(805,NULL,10,NULL,'Διπλό κόκκινο τριαντάφυλλο σε γυάλινη καμπάνα','RG-1201',NULL,'Δύο κόκκινα αναλλοίωτα τριαντάφυλλα σε στρογγυλή γυάλινη καμπάνα με ξύλινη βάση. Τα αναλλοίωτα τριαντάφυλλα ή FOREVER ROSES διατηρούν το χρώμα και την υφή τους για πολλά χρόνια. Πρόκειται για αληθινά τριαντάφυλλα τα οποία μετά από συγκεκριμένη επεξεργασία έχουν την όψη ενός αληθινού λουλουδιού.','Double red rose in a round glass',NULL,'Two unaltered red roses in a round glass with a wooden base. Unchanged roses or FOREVER ROSES retain their color and texture for many years. These are real roses which after a certain treatment have the look of a real flower.',45,'diplo-kokkino-triantafyllo-se-gyalinh-kampana','85571.jpg',1,86,1,'2021-11-29','2022-03-03'),(806,NULL,10,NULL,'Μαύρο τριαντάφυλλο σε παραλληλόγραμμη γυάλα','RG-1202',NULL,'Μαύρο αναλλοίωτο τριαντάφυλλο σε παραλληλόγραμμη γυάλα με ξύλινη βάση. Τα αναλλοίωτα τριαντάφυλλα ή FOREVER ROSES διατηρούν το χρώμα και την υφή τους για πολλά χρόνια. Πρόκειται για αληθινά τριαντάφυλλα τα οποία μετά από συγκεκριμένη επεξεργασία έχουν την όψη ενός αληθινού λουλουδιού.','Black rose in a rectangular glass bowl',NULL,'Black unaltered rose in a rectangular glass bowl with a wooden base. Unchanged roses or FOREVER ROSES retain their color and texture for many years. These are real roses which after a certain treatment have the look of a real flower.',30,'mayro-triantafyllo-se-parallhlogrammh-gyala','72731.jpg',0,86,1,'2021-11-29','2022-03-03'),(807,NULL,10,NULL,'Τριπλό κόκκινο τριαντάφυλλο σε μεγάλη στρογγυλή καμπάνα','RG-1205',NULL,'Τρία κόκκινα αναλλοίωτα τριαντάφυλλα σε μεγάλη στρογγυλή γυάλινη καμπάνα με ξύλινη βάση. Τα αναλλοίωτα τριαντάφυλλα ή FOREVER ROSES διατηρούν το χρώμα και την υφή τους για πολλά χρόνια. Πρόκειται για αληθινά τριαντάφυλλα τα οποία μετά από συγκεκριμένη επεξεργασία έχουν την όψη ενός αληθινού λουλουδιού.','Triple red rose in a large round bowl',NULL,'Three unaltered red roses in a large round glass bell with a wooden base. Unchanged roses or FOREVER ROSES retain their color and texture for many years. These are real roses which after a certain treatment have the look of a real flower.',60,'triplo-kokkino-triantafyllo-se-megalh-stroggylh-kampana','23942.jpg',1,86,1,'2021-11-29','2021-11-29'),(808,NULL,7,NULL,'Garden Plants','PL2',NULL,'Σύνθεση με φυτά ορχιδέα, σπαθίφυλλο, ανθούριο,σε ωραία ζωντανά χρώματα  ιδανικό για πολλές κοινωνικές εκδηλώσεις, γιά όλους τους χώρους στο σπίτι ή το γραφείο','Garden Plants',NULL,'Arangement with orchid plants, spathifilum, anthurium, in beautiful vibrant colors ideal for many social events,\r\nfor all areas at home or office',83,'garden-plants','84554.jpg',1,56,1,'2021-11-30','2021-11-30'),(809,NULL,15,NULL,'Σύνθεση με Αμαρυλλίδες','AR 4',NULL,'Ένα όμορφο λουλούδι όπως η αμαρυλλίς, ανθίζει τα Χριστούγεννα και μέσα σένα κασπώ χρυσό δίνει ιδιαίτερη λάμψη για να διακοσμήσει και να ομορφύνει το χώρο που θα το βάλουμε, μπορεί να προσφερθεί σε όλες τις κοινωνικές εκδηλώσεις','Amaryllis Arangement',NULL,'A beautiful flower like amaryllis, blooms at Christmas and inside a golden pot gives a special glow to decorate\r\nand beautify the space where we will put it, it can be offered at all social events',43,'synthesh-me-amaryllides','24931.jpg',0,56,1,'2021-11-30','2022-01-09'),(810,NULL,3,NULL,'Μπουκέτο με 9 Ζέρμπερες',NULL,NULL,'Στρογγυλό μπουκέτο με ζέρμπερες σε διάφορα χρώματα, σολιντάστερ και ολλανδικές πρασινάδες.','Bouquet of 9 Gerberas',NULL,'',25,'mpoyketo-me-9-zermperes','43977.jpg',1,52,1,'2021-11-30','2021-11-30'),(811,NULL,3,NULL,