 Καλάθι!',NULL,NULL,'Φυτό Ποϊνσέτια σε υπέροχο καλάθι!','Christmas Flowers in a Basket',NULL,'',45,'fyto-poinsetia-se-yperoxo-kalathi','10271.jpg',0,52,1,'2021-11-30','2022-01-13'),(842,NULL,15,NULL,'Εορταστικό Στεφάνι',NULL,NULL,'Στεφανάκι μεσαίου μεγέθους με έλατο, τούγια, πεύκο, αποξηραμένα φρούτα και κανέλες, κουκουνάρια, φιογκάκια και βαμβάκια.','Christmas Wreath',NULL,NULL,45,'eortastiko-stefani','13529.jpg',0,52,1,'2021-11-30','2022-01-13'),(843,NULL,15,NULL,'Ποϊνσέτια σε Φωτιζόμενο Καφάσι με Κόκκινο Κρασί – Special',NULL,NULL,'Καφέ ξύλινο καφάσι με καπάκι, με φωτισμό σε ψυχρό φως με μεσαίου μεγέθους φυτό Ποϊνσέτια, διακοσμητικά κουκουνάρια, και κόκκινο κρασί.\r\nΣπέσιαλ δώρο για τους αγαπημένους σας! Εξαίρετη επιλογή και για επαγγελματικό δώρο.','Gift Box with Christmas Flower and Wine',NULL,'',65,'poinsetia-se-fwtizomeno-kafasi-me-kokkino-krasi-special','61580.jpg',0,52,1,'2021-11-30','2022-01-13'),(844,NULL,15,NULL,'Led me up!',NULL,NULL,'Φυτό Εχεβέρια σε χρυσό ή κόκκινο ή μωβ ή μπλε χρώμα, και κυπαρισσάκι, μέσα σε γιορτινό καραβάκι με λεντ φωτάκια! Μια εορταστική επιλογή, που συνδυάζει φυτά και διακόσμηση στο χώρο σας!\r\n\r\nΗ μπογιά είναι απολύτως ασφαλής για το φυτό, δε χαλάει και δεν επηρεάζει τη βιωσιμότητά του.','Led me up!',NULL,'',55,'led-me-up','96061.jpg',0,52,1,'2021-11-30','2022-01-13'),(845,NULL,15,NULL,'Μεγάλο Καλάθι με Αλεξανδρινά',NULL,NULL,'Μεγάλο ψάθινο καλάθι με χερούλι με 6 αλεξανδρινά.','Basket with Christmas Flowers',NULL,'',50,'megalo-kalathi-me-alexandrina','66316.jpg',0,52,1,'2021-11-30','2022-01-13'),(846,NULL,15,NULL,'Ποϊνσέτια σε Ζάρι',NULL,NULL,'Φυτό Ποϊνσέτια σε ποτ Ζαριού σε λευκό χρώμα!','Christmas Flower in Dice Pot',NULL,'',25,'poinsetia-se-zari','82670.jpg',0,52,1,'2021-11-30','2022-01-13'),(847,NULL,15,NULL,'Ποϊνσέτια (Αλεξανδρινό) σε Καλάθι',NULL,NULL,'Ποϊνσέτια (Αλεξανδρινό) σε Vintage καλάθι.','Christmas Flower in a Vintage Basket',NULL,'',28,'poinsetia-alexandrino-se-kalathi','88895.jpg',0,52,1,'2021-11-30','2022-01-13'),(848,NULL,15,NULL,'Εορταστικό Καλάθι με Ποτό – Beauty & the Beast και Σοκολάτες',NULL,NULL,'Στρογγυλό ή παραλληλόγραμμο καλάθι με ποτό τεκίλα Jose Quervo κίτρινη, αληθινό αφυδατωμένο τριαντάφυλλο Beauty and the Beast με φωτάκια led θερμού χρώματος, σοκολατάκια Noisette, σοκολάτες ΙΟΝ αμυγδάλου, κουτί ξύλινο για ποτό με εργαλεία, χόρτο σε φυσικό χρώμα και εορταστικούς τόνους από έλατο, πεύκο, τούγια, φιόγκους και κορδέλες.\r\n\r\nΤο καλάθι ενδέχεται να διαφέρει απ’ το εικονιζόμενο.','Christmas Luxury Basket',NULL,'Wine, Beauty and the Beast and Chocolates',125,'eortastiko-kalathi-me-poto-beauty-the-beast-kai-sokolates','83757.jpg',0,52,1,'2021-11-30','2022-01-13'),(849,NULL,15,NULL,'The Christmas Arrangement',NULL,NULL,'ντυπωσιακή όρθια σύνθεση Χριστουγέννων με έλατο, τουγια, πεύκο, κουκουνάρια, στερλίτσια, κόκκινα τριαντάφυλλα, σολιντάστερ, διακοσμητικές χριστουγεννιάτικες μπάλες, γιρλάντες, φιόγκους, σάλεξ λευκό, αποξηραμένα φρούτα, pampas grass και κορδέλες. Συμπεριλαμβάνονται φωτάκια λεντ με μπαταρίες.','The Christmas Arrangement',NULL,'',70,'the-christmas-arrangement','57025.jpg',1,52,1,'2021-11-30','2021-11-30'),(850,NULL,15,NULL,'Gold Crest Christmas Mood',NULL,NULL,'Gold Crest στολισμένο με μπαλίτσες και φιογκάκια, και φωτάκια λεντ, τυλιγμένο σε λινάτσα.','Gold Crest Christmas Mood',NULL,'',25,'gold-crest-christmas-mood','16028.jpg',0,52,1,'2021-11-30','2022-01-14'),(851,NULL,15,NULL,'Ποϊνσέτια σε Πουγκί',NULL,NULL,'Φυτό Ποϊνσέτια σε βελούδινο κόκκινο πουγκί!','Christmas Flowers in a Pouch',NULL,'',25,'poinsetia-se-poygki','90784.jpg',0,52,1,'2021-11-30','2022-01-13'),(852,NULL,15,NULL,'Σετ με Μεγάλο Κυπαρίσσι – Αλεξανδρινό Πιγκουίνος και Γούρι',NULL,NULL,'Εορταστικό σετ!\r\nΠεριλαμβάνει μεγάλου μεγέθους κυπαρίσσι, στολισμένο με αποξηραμένα φρούτα και κανέλες, φιογκάκια και μπαλίτσες, φυτό Ποϊνσέτια σε ποτ Πιγκουίνου, και εορταστικό χειροποίητο γούρι του 2021!\r\nΤα γούρια είναι χειροποίητα, δικής μας έμπνευσης και κατασκευής, και ενδέχεται να διαφέρουν απ’ το εικονιζόμενο.','Elwoodii & Christmas Flower & Charm',NULL,'',50,'set-me-megalo-kyparissi-alexandrino-pigkoyinos-kai-goyri','63424.jpg',0,52,1,'2021-11-30','2022-01-13'),(853,NULL,15,NULL,'Χριστουγεννιάτικο Δεντράκι',NULL,NULL,'Πανέμορφο και εντυπωσιακότατα δέντρο με έλατο και χριτουγεννιάτικα στολίδια, ό,τι πρέπει για να εντυπωσιάσετε!','Christmas Tree',NULL,'',95,'xristoygenniatiko-dentraki','24383.jpg',0,52,1,'2021-11-30','2022-01-13'),(854,NULL,15,NULL,'Φλούδα Κορμού Δέντρου',NULL,NULL,'Αληθινή φλούδα δέντρου με εορταστική σύνθεση, με κόκκινο ψηλό κερί, κουκουνάρια, αποξηραμένα φρούτα, σαφάρι, ξύλα πεύκου, διακομητικά κόκκινα κλαδιά, κανέλες, κόκκινο και κίτρινο σολιντάστερ, δωράκια, χριστουγεννιάτικα διακοσμητικά στικ, μπάλες, κορδέλες με γκλίτερ, πεύκο, έλατο και τούγια!\r\nΠρόκειται για αληθινή φλούδα δέντρου, συνεπώς το σχήμα της φλούδας μπορεί να ποικίλει με αυτό της φωτογραφίας.','Christmas Wooden Arrangement',NULL,'',38,'floyda-kormoy-dentroy','63809.jpg',0,52,1,'2021-11-30','2022-01-13'),(855,NULL,15,NULL,'Κόκκινο Κουτί με Ποϊνσέτια και Κρασί',NULL,NULL,'Σουέτ κόκκινο κουτί με μεσαίου μεγέθους ποινσέτια και κρασί! Ό,τι πρέπει για επίσκεψη σε φιλικό ή συγγενικό σπίτι, καθώς συνδυάζει φυτό και ποτό!','Box with Wine and Christmas Flower',NULL,'',35,'kokkino-koyti-me-poinsetia-kai-krasi','51425.jpg',0,52,1,'2021-11-30','2022-01-14'),(856,NULL,15,NULL,'Φέτα Κορμού Δέντρου με Γιορτινή Διάθεση',NULL,NULL,'Το κάτι διαφορετικό.\r\nΑληθινός κορμός δέντρου ακακίας, κομμένος σε φέτα, με κόκκινο ψηλό κερί, διακοσμητικά όπως χρυσά κουκουνάρια, φιογκάκια, μπάλες, κανέλες, και δωράκια, με κόκκινα τριαντάφυλλα, ίλεξ, σαφάρι, κόκκινο και κίτρινο σολιντάστερ, ερίτζιουμ, πεύκο, έλατο και τούγια.\r\nΠρόκειται για αληθινή φέτα κορμού δέντρου ακακίας, συνεπώς το σχήμα (εσωχές) μπορεί να ποικίλει με αυτό της φωτογραφίας.','Absolute Christmas Arrangement',NULL,'',40,'feta-kormoy-dentroy-me-giortinh-diathesh','40463.jpg',0,52,1,'2021-11-30','2022-01-13'),(857,NULL,15,NULL,'Χριστούγεννα με Αμαρυλλίδες',NULL,NULL,'Χριστούγεννα με Αμαρυλλίδες','Red Amaryllis Arrangement',NULL,'',70,'xristoygenna-me-amaryllides','34302.jpg',0,52,1,'2021-11-30','2022-01-13'),(858,NULL,15,NULL,'Γιορτινό Tραπέζι',NULL,NULL,'Μεγάλη εορταστική σύνθεση με τρία κόκκινα κεριά, με κόκκινα τριαντάφυλλα, γκι, ρόδια, τούγια, πεύκο, έλατο, κουκουνάρια και χριστουγεννιάτικες μπάλες.','Christmas Eve',NULL,'',65,'giortino-trapezi','41416.jpg',0,52,1,'2021-11-30','2022-01-13'),(859,NULL,15,NULL,'Merry Christmas',NULL,NULL,'Στρογγυλή σύνθεση σε ίνοξ βάση με κόκκινο κερί, μπράτσικα, τριαντάφυλλα, ίλεξ, χρυσά κουκουνάρια, αποξηραμένα φρούτα, σολιντάστερ, βαμβάκια, γλυφιτζούρια, κορδέλες, φιογκάκια, έλατο, τούγια, πεύκο, χριστουγεννιάτικες μπαλίτσες και διακοσμητικά κλαδιά.','Merry Christmas',NULL,'',40,'merry-christmas','72714.jpg',0,52,1,'2021-11-30','2022-01-13'),(860,NULL,15,NULL,'Γιορτινό Επιτραπέζιο – 80 cm',NULL,NULL,'Η καλύτερη επιλογή για να υποδεχτείτε τους καλεσμένους σας στο γιορτινό τραπέζι που έχετε ετοιμάσει! Ανάψ’τε το κερί και γεμίστε φως και χαρά το σπίτι σας! Με κόκκινο κερί, γλυφιτζούρια,  ορχιδέες σιμπίτιουμ, γκι, μυρωδάτες κανέλες, έλατο, πεύκο, τούγια, σολιντάστερ, βαμβάκια, ίλεξ, ορχιδέες σιμπίτιουμ, χρυσά κουκουνάρια, κορδέλες, αποξηραμένα φρούτα, χριστουγεννιάτικες μπαλίτσες, και διακοσμητικά κλαδιά!','Christmas Arrangement - 80 cm',NULL,'',30,'giortino-epitrapezio-80-cm','7085.jpg',0,52,1,'2021-11-30','2022-01-13'),(861,NULL,4,NULL,'Πιατέλα με Κόκκινα Τριαντάφυλλα και Σιμπίτιουμ',NULL,NULL,'Μεγάλη πιατέλα με γκρουπαριστά 17 κατακόκκινα τριαντάφυλλα, ορχιδέα σιμπίτιουμ, φραγκρανσς, γυψοφύλλη, σολινταγκο, και ολλανδικές πρασινάδες.\r\n\r\nΤα εποχιακά και μη διαθέσιμα άνθη, αντικαθίστανται με άνθη ίσης αισθητικής και αξίας.','Luxury Red and Green Arrangement',NULL,NULL,110,'piatela-me-kokkina-triantafylla-kai-simpitioym','14865.jpeg',1,52,1,'2021-11-30','2022-01-18'),(862,NULL,15,NULL,'Χριστουγεννιάτικο Κουτί',NULL,NULL,'Από τα πιό όμορφα χριστουγεννιάτικα δώρα που μπορείτε να προσφέρετε! Κουτί με έλατο, τούγια, πεύκο, κουκουνάρια, γκι, μήλα κορδέλες και αποξηραμένα φρούτα!','Christmas Box',NULL,'',40,'xristoygenniatiko-koyti','56942.jpg',0,52,1,'2021-11-30','2022-01-13'),(863,NULL,15,NULL,'Όρθια Εορταστική Σύνθεση',NULL,NULL,'Όρθια σύνθεση σε πήλινο κόκκινου χρώματος κασπώ, με βερόνικα, κουκουνάρια, αποξηραμένα φρούτα, κόττον, δύο κεράκια, πεύκο, τούγια, έλατο και σολιντάστερ.','Xmas Time',NULL,'',25,'orthia-eortastikh-synthesh','68755.jpg',0,52,1,'2021-11-30','2022-01-13'),(864,NULL,15,NULL,'Ποϊνσέτια: Μια Αγκαλιά και Κάτι',NULL,NULL,'Ποϊνσέτια διαμέτρου περίπου 70 – 80 εκατοστών. Μια αγκαλιά και κάτι! Μια πολύ εντυπωσιακή επιλογή για να χαρίσετε στον εαυτό σας, στα αγαπημένα σας πρόσωπα, σε επαγγλεματικές υποχρεώσεις, ή και για να δώσετε μια εορταστική νότα στο γραφείο σας!','Big Christmas Flower',NULL,'',40,'poinsetia-mia-agkalia-kai-kati','51268.jpg',0,52,1,'2021-11-30','2022-01-13'),(865,NULL,15,NULL,'Εορταστική Εχεβέρια – Χρυσό',NULL,NULL,'Φυτό Εχεβέρια σε χρυσό ή κόκκινο ή μωβ ή μπλε χρώμα με γκλίτερ σε χρυσό ποτ ζαριού! Μια εορταστική επιλογή φυτού ιδιαιτέρως ανθεκτικού, εσωτερικού και εξωτερικού χώρου.\r\n\r\nΗ μπογιά είναι απολύτως ασφαλής για το φυτό, δε χαλάει και δεν επηρεάζει τη βιωσιμότητά του.','Dyed Echeveria in Dice Pot',NULL,'',25,'eortastikh-exeberia-xryso','926.jpg',0,52,1,'2021-11-30','2022-01-14'),(866,NULL,15,NULL,'Ορχιδέα Φαλαίνοψις σε Ασημί Ζάρι',NULL,NULL,'Ορχιδέα Φαλαίνοψις σε πήλινο ποτ σχήματος ασημί ζαριού.\r\nΧρώμα ορχιδέας, μωβ, λευκό ή δίχρωμο.','Orchid Phalaenopsis - Silver Doce',NULL,'',45,'orxidea-falainopsis-se-ashmi-zari','40034.jpg',0,52,1,'2021-11-30','2022-01-13'),(867,NULL,15,NULL,'Ορχιδέα Φαλαίνοψις σε Χρυσό Ζάρι',NULL,NULL,'Ορχιδέα Φαλαίνοψις σε πήλινο ποτ σχήματος χρυσού ζαριού.\r\nΧρώμα ορχιδέας, μωβ, λευκό ή δίχρωμο','Orchid Phalaenopsis - Gold Dice',NULL,'',45,'orxidea-falainopsis-se-xryso-zari','52580.jpg',0,52,1,'2021-11-30','2022-01-13'),(868,NULL,11,NULL,'Λεβ