ά δέντρα. Το φύλλωμα του είναι πολύ μικρό και μεγαλώνει κατά μήκος των κλαδιών του, καθιστώντας το κλάδεμα εύκολη υπόθεση.',NULL,'Το Bonsai είναι ένα όμορφο διαμορφωμένο μικροσκοπικό δέντρο. Η αειθαλής Carmona είναι ένα από τα πιο επιβλητικά τροπικά δέντρα. Το φύλλωμα του είναι πολύ μικρό και μεγαλώνει κατά μήκος των κλαδιών του, καθιστώντας το κλάδεμα εύκολη υπόθεση.','Bonsai',NULL,'Bonsai is a beautifully shaped tiny tree. The evergreen Carmona is one of the most imposing tropical trees. Its foliage is very small and grows along its branches, making pruning easy.',60,'mponsai','20859.jpeg',0,106,1,'2022-01-21','2022-05-08'),(1399,NULL,4,NULL,'VICTORIA','Πανέμορφη λευκή καπελιέρα με ηλιάνθους, λυσίανθους, τριαντάφυλλα και άνθη εποχής.',NULL,'','VICTORIA',NULL,'Beautiful white hat box with sunflowers, lysines, roses and seasonal flowers.',60,'victoria','91189.jpeg',0,106,1,'2022-01-21','2022-07-31'),(1400,NULL,4,NULL,'EMILLY','Καπελιέρα με λυσίανθους, τριαντάφυλλα, ορχιδέες και φυλλώματα.',NULL,'Καπελιέρα με λυσίανθους, τριαντάφυλλα, ορχιδέες και φυλλώματα.','EMILLY',NULL,'Hat box with lysianthus, roses, orchids and foliage.',50,'emilly','32204.jpeg',0,106,1,'2022-01-21','2022-07-31'),(1401,NULL,4,NULL,'Σύνθεση λουλουδιών \"ΜΑΡΓΑΡΙΤΑ\"','Σύνθεση λουλουδιών σε καλάθι Επιλέξτε σύνθεση λουλουδιών σε όποια απόχρωση και μέγεθος επιθυμείτε. Ρωτήστε μας για επιλογές σε μεγέθη και ποικιλίες λουλουδιών.',NULL,'Σύνθεση λουλουδιών σε καλάθι\r\nΕπιλέξτε σύνθεση λουλουδιών σε όποια απόχρωση και μέγεθος επιθυμείτε.\r\nΡωτήστε μας για επιλογές σε μεγέθη και ποικιλίες λουλουδιών.','Flower arrangement in basket \"MARGARET\"',NULL,'Flower arrangement in a basket\r\nChoose a flower arrangement in any shade and size you want.\r\nAsk us for choices in flower sizes and varieties.',40,'synthesh-loyloydiwn-margarita','23615.jpeg',0,106,1,'2022-01-21','2022-07-31'),(1402,NULL,6,NULL,'Ροζ ορχιδέα','Το φυτό ορχιδέας Phalaenopsis είναι  ένα υπέροχο δώρο ή ένα υπέροχο διακοσμητικό για το σπίτι 