 by the movie \"Beauty and the Beast\" A special way to impress your loved one by giving them a gift that will stay \"forever\". 15cm-25cm',35,'kokkino-triantafyllo-sth-gyala-foreverrose','41952.png',1,80,1,'2022-02-03','2022-02-03'),(1647,NULL,3,NULL,'Μπουκέτο με 25 κόκκινα τριαντάφυλλα','43768',NULL,'Τα κόκκινα τριαντάφυλλα εκφράζουν την αληθινή αγάπη, τον σεβασμό, την δύναμη και το πάθος. Το κόκκινο χρώμα υποδηλώνει έντονα συναισθήματα όπως η αγάπη και η επιθυμία. Εμείς επιλέγουμε τα 25 πιο όμορφα τριαντάφυλλα από το Εκουαδόρ και σας τα φτιάχνουμε ένα πανέμορφο μπουκέτο','Bouquet with 25 red roses',NULL,'Red Roses express true love, respect, strength and passion. The colour red indicates strong emotions such as love and desire.',40,'mpoyketo-me-25-kokkina-triantafylla','24473.webp',1,80,1,'2022-02-03','2022-02-03'),(1648,NULL,12,NULL,'Τριανταφυλλένιος Αρκούδος 40cm (λευκό με κόκκινη καρδιά)','5009',NULL,'Τα πιο εντυπωσιακά αρκουδάκια από τριαντάφυλλα που κρατάνε για πάντα !\r\n\r\nΠροσφέρεται μέσα σε κλειστό διάφανο κουτί δώρου.','RoseBear 40cm (White with red heart)',NULL,'The most impressive teddy bears made of roses that last forever !\r\n\r\nOffered in a closed transparent gift box.',40,'triantafyllenios-arkoydos-40cm-leyko-me-kokkinh-kardia','54366.jpeg',1,80,1,'2022-02-03','2022-02-03'),(1649,NULL,5,NULL,'Κουτί I❤️U','53012',NULL,'Ένα κουτί που κρύβει τεράστια έκπληξη ! Ανοίγοντας το καπάκι που περιέχει το κουτί, κρύβει εντυπωσιακά κόκκινα τριαντάφυλλα σχηματίζοντας τη φράση “I ❤ U” (I love you).\r\n\r\nΠρόκειται για φρέσκα τριαντάφυλλα μέσα σε box, προσέχοντας πολύ την διάταξη και τη θέση που προσαρμόζονται τα τριαντάφυλλα μέσα στο κουτί ώστε να διακρίνεται εύκολα το “I ❤ U”.','Box I❤️U',NULL,'A box that hides a huge surprise ! Opening the lid containing the box, it hides impressive red roses forming the phrase \"I ❤ U\" (I love you).\r\n\r\nThese are fresh roses in a box, taking great care of the arrangement and positioning of the roses inside the box so that the \"I ❤ U\".',60,'koyti-iu','9114.jpeg',1,80,1,'2022-02-03','2022-02-03'),(1650,NULL,6,NULL,'Ορχιδέα φαλαίνοψις μπλε','522252',NULL,'Κατάλληλη θέση γι’ αυτές είναι φωτεινό σημείο του σπιτιού, με έμμεσο διάχυτο φυσικό φως. Η απευθείας έκθεση στο ηλιακό φως μπορεί να προκαλέσει σοβαρά εγκαύματα στα φύλλα του. Η έλλειψη φωτισμού κάνει τα φύλλα σκούρα πράσινα, ενώ το υπερβολικό φως τα κάνει να παίρνουν ανοιχτό πράσινο χρωματισμό ή να κιτρινίζουν.','Orchid Phalaenopsis Blue Royal',NULL,'Impressive, elegant, graceful and special are a few words that can define her. The blue coloured phalaenopsis orchid is very special as a gift and a very good investment as it will reward you with a long lasting and beautiful flowering !',15,'orxidea-falainopsis-mple','93973.jpeg',1,80,1,'2022-02-03','2022-02-03'),(1651,NULL,7,NULL,'Σύνθεση φυτών εσωτερικού χώρου','989876',NULL,'Ποικιλία φυτών σε ιδιαίτερο κεραμικό. Μια ωραία πρόταση δώρου για εορτές και εγκαίνια . Ανθεκτικά φυτά  εσωτερικού χώρου με ελάχιστες απαιτήσεις φροντίδας.','Ceramic Pot Plants',NULL,'Variety of plants in special ceramics. A nice gift offer for holidays and openings. Durable indoor plants with minimal care requirements.',20,'synthesh-fytwn-eswterikoy-xwroy','51222.jpeg',0,80,1,'2022-02-03','2022-03-30'),(1652,NULL,8,NULL,'Ανθουριο','001',NULL,'Φυτό γλάστρας !','Anthurium',NULL,'Pot plant!',14,'anthoyrio','15270.jpg',1,104,1,'2022-02-06','2022-02-06'),(1654,NULL,8,NULL,'Σπαθιφυλλο','002',NULL,'Φυτό γλάστρας','Spathiphyllum',NULL,'Pot plant!',13,'spathifyllo','24805.jpg',1,104,1,'2022-02-06','2022-02-06'),(1655,NULL,18,NULL,'Αποχυμωμένο τριαντάφυλλο σε κουτί δώρου.',NULL,NULL,'τα αποχυμωμένα τριαντάφυλλα έχουν διάρκεια ζωής 5-20 χρόνια.','preserved rose in a box, that last from 5-20 yeras',NULL,NULL,25,'apoxymwmeno-triantafyllo-se-koyti-dwroy','98821.jpg',1,50,1,'2022-02-07','2022-02-07'),(1656,NULL,18,NULL,'Αρκουδάκι με foam τριαντάφυλλα και καρδούλα plexi glass',NULL,NULL,'Τα foam roses κρατούν για πάντα!',