UN LOVE',NULL,'BOUQUET WITH ROSES AND HELIANTHUS ANNUS',30,'sun-love','74610.jpg',1,24,1,'2022-03-03','2022-03-03'),(1957,NULL,4,NULL,'OFFER IT',NULL,NULL,'ΟΡΧΙΔΕΑ ΣΙΜΠΙΝΤΙΟΥΜ ΜΕ ΟΙΚΟΛΟΓΙΚΗ ΔΙΑΘΕΣΗ','OFFER IT',NULL,'ORCHIDACEAE SYMBIDIUM WITH ECO MOOD',10,'offer-it','36516.jpg',1,24,1,'2022-03-03','2022-03-03'),(1958,NULL,3,NULL,'ΑΡΩΜΑΤΙΚΑ ΖΟΥΜΠΟΥΛΙΑ',NULL,NULL,'ΜΠΟΥΚΕΤΟ ΜΕ ΖΟΥΜΠΟΥΛΙΑ','AROMATIC  HYACINTHUS',NULL,'BOUQUET WITH HYACINTHUS',30,'arwmatika-zoympoylia','94316.jpg',1,24,1,'2022-03-03','2022-03-03'),(1959,NULL,3,NULL,'CHIC & SIMPLE',NULL,NULL,'Για τον άνθρωπο που εντυπωσιάζει με την απλότητά του και είναι πάντα Chic & Simple. Σίγουρα, θα εντυπωσιαστεί με τις κίτρινες τουλίπες. Το πιο “σικ” μπουκέτο, μόλις το βρήκατε.','CHIC & SIMPLE',NULL,'For the one that impresses everyone with their simple nature, always being Chic & Simple. That person, will absolutely be impressed back, with this bouquet. You just found the most chic one. What a bouquet!',30,'chic-simple','13891.jpg',1,65,1,'2022-03-04','2022-03-04'),(1960,NULL,3,NULL,'PINK BLUSH',NULL,NULL,'Αν το κόκκινο είναι το χρώμα του έρωτα, το ροζ είναι το χρώμα του πάθους.','PINK BLUSH',NULL,'If red is the colour of love, pink might as well be the one of passion.',30,'pink-blush','55616.jpg',1,65,1,'2022-03-04','2022-03-04'),(1961,NULL,3,NULL,'INEFFABLE',NULL,NULL,'Ineffable: Τόσο εντυπωσιακό που δεν μπορεί να περιγραφεί με λόγια.\r\n\r\nΌταν δεν φτάνουν οι λέξεις, έρχεται η ανθοδέσμη.\r\nΈνα μπουκέτο με τουλίπες και τριαντάφυλλα Ecuador, ιδανικό για κάθε περίσταση','INEFFABLE',NULL,'Ineffable: So stunning, no words could describe it.\r\n\r\nWhen words are not enough, bouquets may speak.\r\nA bouquet of tulips and Ecuador roses, is without a doubt perfect, for any occasion.',35,'ineffable','73533.jpg',1,65,1,'2022-03-04','2022-03-04'),(1962,NULL,3,NULL,'SMALL BOUQUET, BIG LOVE',NULL,NULL,'Κάποιες φορές στα πιο μικρά πράγματα, κρύβονται τα πιο μεγάλα!\r\nΜπουκέτο με τριαντάφυλλα και τουλίπες.','SMALL BOUQUET, BIG LOVE',NULL,'Sometimes, the small things, are the ones that matter big time!\r\nThey say, go big or go home. But, what if a small bouquet is as stunning as such?',35,'small-bouquet-big-love','83031.jpg',1,65,1,'2022-03-04','2022-03-04'),(1963,NULL,3,NULL,'THE SUN IN YOUR EYES',NULL,NULL,'Ένα μπουκέτο με ηλίανθους έχει μόνο φανατικούς υποστηρικτές. Αυτούς που τους λατρεύουν!\r\n\r\nΟι ηλίανθοι ή αλλιώς ηλιοτρόπια, αποτελούν ένα λουλούδι που είναι μία κατηγορία από μόνο του.','THE SUN IN YOUR EYES',NULL,'A bouquet of sunflowers only has the biggest enthousiasts.\r\nThis particular flower, surely stands on its own.',40,'the-sun-in-your-eyes','25212.jpg',1,65,1,'2022-03-04','2022-03-04'),(1964,NULL,3,NULL,'RED PASSION',NULL,NULL,'Ένα μπουκέτο με σιωπηλή φινέτσα αλλά τόσο δυνατή προσωπικότητα. Με την αδιαπραγμάτευτη ομορφιά του κυριαρχεί στις επιλογές των πελατών μας.','RED PASSION',NULL,'A bouquet of silent, yet strong and bold finesse. It prevails in the heart’s of our customers, due to its non negotiable beauty and elegance.',50,'red-passion','71662.jpg',1,65,1,'2022-03-04','2022-03-04'),(1965,NULL,3,NULL,'LITTLE HEAVEN',NULL,NULL,'Φέρτε τον παράδεισο στο χώρο που επιθυμείτε.\r\nΤα χρώματα του σιελ και του λευκού, συνδυάζονται αρμονικά με το peach και τις συνοδευτικές πρασινάδες. Ο παράδεισος στην αγκαλιά της.','LITTLE HEAVEN',NULL,'Bring heaven, into your space.\r\nThe light blue and light orange colours are combined in such harmony, making a tantalising end result. Heaven, in a person’s arms, literally.',50,'little-heaven','67630.jpg',1,65,1,'2022-03-04','2022-03-04'),(1966,NULL,3,NULL,'HOLLYWOOD LOVE',NULL,NULL,'Κάντε το αγαπημένο σας πρόσωπο να νιώσει σαν σταρ του σινεμά με την απόλυτη ανθοδέσμη!\r\n15 πανέμορφα κόκκινα Equador τριαντάφυλλα, γράφουν το σενάριο…!','HOLLYWOOD LOVE',NULL,'Make that special someone, feel like the ultimate Hollywood star. For you, they may already be one.\r\n15 beautiful Ecuador roses, write the script of your movie.',50,'hollywood-love','15584.jpg',1,65,1,'2022-03-04','2022-03-21'),(1967,NULL,3,NULL,'BEAUTIFUL PINK',NULL,NULL,'Πόσο ροζ μπορεί να χωρέσει σε ένα μπουκέτο Fiorentino LFS; Μαντέψτε…\r\nΠολύ!\r\nΜοιραστείτε με αυτό το μπουκέτο, τα πιο τολμηρά σας συναισθήματα και τις πιο ρομαντικές σας σκεψεις.','BEAUTIFUL PINK',NULL,'How much pink can a bouquet have? With our services…the sky is the limit! So guess…\r\nLet’s say, a lot.\r\nExpress your boldest and most romantic feelings.',65,'beautiful-pink','13883.jpg',1,65,1,'2022-03-04','2022-03-04'),(1968,NULL,3,NULL,'HEAVEN',NULL,NULL,'Φέρτε τον παράδεισο στο χώρο που επιθυμείτε.\r\nΤα χρώματα του σιελ και του λευκού, συνδυάζονται αρμονικά με το peach και τις συνοδευτικές πρασινάδες. Ο παράδεισος στην αγκαλιά της.','HEAVEN',NULL,'Bring the essence of heaven into your personal space.\r\nThe celesthial colours of baby blue and white merge with peach in great harmony. Heaven is not a place, heaven is her.',65,'heaven','11006.jpg',1,65,1,'2022-03-04','2022-03-04'),(1969,NULL,3,NULL,'THE EVEREST',NULL,NULL,'Για κάποιους η κορυφή του Έβερεστ, είναι ένας άνθρωπος και όχι μία τοποθεσία. Στην αγάπη όμως, πρέπει να κατακτούμε αυτή τη κορυφή καθημερινά. Κάθε φορά όμως, η θέα αξίζει τον κόπο.','THE EVEREST',NULL,'For some the mountaip top, or else The Everest, is a person. Not a location. Love though, is a peak that must be conquered daily. But everytime, the view is so worth it.',85,'the-everest','66930.jpg',1,65,1,'2022-03-04','2022-03-04'),(1970,NULL,3,NULL,'SERENDIPITY',NULL,NULL,'Τη συναντάς τυχαία. Επειδή άργησες να ξεκινήσεις πήρατε το ίδιο λεωφορείο. Την ερωτεύεσαι με την πρώτη ματιά.\r\nΑυτό σημαίνει Serendipity.','SERENDIPITY',NULL,'You meet her by chance. You were late, and took the same bus as her. You fall in love with her at first sight.\r\nThis is the meaning of Serendipity.',90,'serendipity','97963.jpg',1,65,1,'2022-03-04','2022-03-04'),(1971,NULL,4,NULL,'KEEP CALM',NULL,NULL,'Χαρίστε μία νότα γαλήνης και φρεσκάδας στα αγαπημένα σας πρόσωπα με μία πανέμορφη σύνθεση από λευκά και εκρού λουλούδια.','KEEP CALM',NULL,'Add a fresh touch of serenity into your loved ones’ universe, with this brilliant flower arrangement of white and beige flowers, put in a lovely pot.',40,'keep-calm','2982.jpg',1,65,1,'2022-03-04','2022-03-04'),(1972,NULL,5,NULL,'SWEETNESS',NULL,NULL,'Ένας συνδυασμός τόσο γλυκός, που είναι απλά ακαταμάχητος!\r\nΗ σύνθεση Sweetness, στο υπέροχο λευκό στρογγυλό κουτί, μας κάνει να λατρέψουμε όλες τις αποχρώσεις του ροζ.\r\nΚαι τα λουλούδια τους! Βάλτε λίγο ρομαντισμό στη ζωή σας…δεν θα το μετανιώσετε.','SWEETNESS',NULL,'The sweetest indulgence in a box with fresh flowers!\r\nAn arrangement of fresh, pink flowers in a luxurious box by Fiorentino LFS is just irresistable!\r\nWhat a beauty… Be a little romantic, and you will not regret it.',60,'sweetness','67580.jpg',1,65,1,'2022-03-04','2022-03-04'),(1973,NULL,5,NULL,'VANILLA FIELDS',NULL,NULL,'Βρείτε στο Vanilla Fields το πιο αγνό και πρόσφορο έδαφος να δείξετε τα συναισθήματά σας, στα αγαπημένα σας πρόσωπα.','VANILLA FIELDS',NULL,'Find the most fertile ground in rich and beautiful “Vanilla Fields” and share your love with the ones you care about.',60,'vanilla-fields','38886.jpg',1,65,1,'2022-03-04','2022-03-04'),(1974,NULL,4,NULL,'BLOODY MOON',NULL,NULL,'Απάντησαμε στο λευκό, με κόκκινο, και ιδού το αποτέλεσμα!\r\nΑν είχε το φεγγάρι κόκκινα τριαντάφυλλα, κάπως έτσι θα έμοιαζε…','BLOODY MOON',NULL,'As if the moon got drunk on sangria…it looks like it is having a whole lot of fun!\r\nCheers to passionate feelings and magical nights that come back in the day dressed up as fresh red roses.',50,'bloody-moon','37324.jpg',1,65,1,'2022-03-04','2022-03-04'),(1975,NULL,4,NULL,'GENTLEMAN\'S WAY',NULL,NULL,'Αν στα λουλούδια υπήρχε αντρικό “dress code” τότε θα ήταν το Gentleman’s Way.\r\nΣύνθεση σε χρυσό κασπό με σιελ ορτανσίες και λουλούδια εποχής σε peach αποχρώσεις.','GENTLEMAN\'S WAY',NULL,'If flowers had a male “dress code”, then it would be Gentleman’s Way.\r\nAn exquisite arrangement in a ceramic golden pot, with baby blue hygrangeas and seasonal flowers in peach.',40,'gentlemans-way','53251.jpg',1,65,1,'2022-03-04','2022-03-04'),(1976,NULL,4,NULL,'SWEET POT',NULL,NULL,'Μία “γλυκιά” πρόταση για τα αγαπημένα σας πρόσωπα.\r\nΣύνθεση σε λευκό κασπό με ροζ και lime αποχρώσεις.','SWEET POT',NULL,'What is sweetness? Some would say it is a state of being. We say it’s a floral arrangement of pink and lime colours.\r\nThis one will make your day.',40,'sweet-pot','97953.jpg',1,65,1,'2022-03-04','2022-03-04'),(1977,NULL,4,NULL,'RED PARADISE',NULL,NULL,'Ο παράδεισος για τους περισσότερους, αποτελείται από πανέμορφα αλλά και απλά, κλασικά πράγματα. Οι κόκκινες τουλίπες είναι ικανές να δημιουργήσουν το οξύμωρο του κόκκινου παραδείσου! Με το εκρηκτικό τους χρώμα μας θυμίζουν τον έρωτα, αλλά με την κομψή τους εμφάνιση μας θυμίζουν την αγνότητα και την σιωπηλή γοητεία.','RED PARADISE',NULL,'Paradise is consisted of classic and simple things,,,stunning also. Red tulips are passionate and pure at the same time. Hence, “Red Paradise”.',40,'red-paradise','31557.jpg',1,65,1,'2022-03-04','2022-03-04'),(1978,NULL,4,NULL,'PINK PARADISE',NULL,NULL,'Ποιό δώρο θα ήταν καλύτερη από μία πανέμορφη σύνθεση με ροζ λουλούδια; Bυθισμένη στο νερό, μέσα στο γυάλινο σωλήνα, η σύνθεση Pink Paradise σας κάνει να ονειρεύεστε ένα παραμυθένιο κόσμο με μαγευτικά χρώματα και όμορφη διάθεση! Καλωσήρθατε στην όασή σας…','PINK PARADISE',NULL,'Which gift could be better than a stunning arrangement of pink flowers? Dipped in water, in the glass tube, the Pink Paradise arrangement makes you dream of a fairytale land, with magical colours and a nice mood! Welcome to your oasis…',45,'pink-paradise','4924.jpg',1,65,1,'2022-03-04','2022-03-04'),(1979,NULL,10,NULL,'THE ONE & ONLY',NULL,NULL,'Σε μια θάλασσα από τέλεια τριαντάφυλλα, πρέπει να επιλέξετε το τέλειο για εσάς.\r\nΑν βρήκατε τον ένα και μοναδικό άνθρωπο σας, οφείλει να το ξέρει.','THE ONE & ONLY',NULL,'If you found the one, make sure to tell them.\r\nIn a sea of perfect rose fields, you must pick the perfect one for you.',15,'the-one-only','68904.jpg',1,65,1,'2022-03-04','2022-03-04'),(1980,NULL,10,NULL,'LOVE | ETERNITY',NULL,NULL,'Η πραγματική αγάπη, κρατάει για πάντα. Οι εποχές θα περνάνε και αυτή θα παραμένει άθικτη στις αλλαγές, κάθε μέρα όλο και πιο όμορφη και πιο δυνατή. Σαν τα τριαντάφυλλα που θα της προσφέρετε.','LOVE | ETERNITY',NULL,'True love is forever. Seasons change, but love remains unaffected, stronger and prettier every day. Like the roses you may offer her.',100,'love-eternity','89675.jpg',1,65,1,'2022-03-04','2022-03-04'),(1981,NULL,10,NULL,'GOLD BEAUTY',NULL,NULL,'Το τέλειο δώρο για τον άνθρωπο που σας κάνει να νιώθετε βασιλιάς του κόσμου.\r\nΟ πιο γοητευτικός και επιβλητικός συνδυασμός χρωμάτων. Ένας συνδυασμός που συμβολίζει την εξοχότητα και την μεγαλοπρέπεια.','GOLD BEAUTY',NULL,'If someone makes you feel like the king of the world, this is for them.\r\nThe most charming and powerful colour combination. It symbolises majesty, royalty and magnificence.',55,'gold-beauty','72820.jpg',1,65,1,'2022-03-04','2022-03-04'),(1982,NULL,10,NULL,'SIMPLE & PERFECT',NULL,NULL,'Μπορεί να κυνηγάτε την τελειότητα για μια ζωή. Το σίγουρο όμως είναι, πως θα την βρείτε στην απλότητα. Το «κλασικό», δεν ονομάζεται έτσι τυχαία.  Τα κόκκινα τριαντάφυλλα, είναι η απόλυτη επιλογή για ένα λόγο. Σε αυτήν τη περίπτωση, οι λόγοι είναι τέσσερις.','SIMPLE & PERFECT',NULL,'You may search for perfection for a lifetime. The sure thing is, you will find it in simplicity. “Classics” are not called so by chance. Red roses are a top choice for a reason. In this case, for four.',45,'simple-perfect','46865.jpg',1,65,1,'2022-03-04','2022-03-04'),(1983,NULL,10,NULL,'THE THREES',NULL,NULL,'«Στους δύο τρίτος δεν χωρεί…» αλλά για τα premium boxes θα κάνουμε μια εξαίρεση.\r\nΤο τρία είναι ο αριθμός της εκπλήρωσης. Κάντε λοιπόν μια ευχή, μαζί με ένα εκπληκτικό δώρο.','THE THREES',NULL,'“Tango is not for three…” but premium boxes of threes sure look dazzling.\r\n\r\nThree is the number of manifestation. So make a wish and a great gift at the same time.\r\nIn this case, three is definitely not a crowd.',35,'the-threes','15947.jpg',1,65,1,'2022-03-04','2022-03-04'),(1984,NULL,10,NULL,'ONE OF A VELVET | ETERNITY',NULL,NULL,'Μερικές φορές, ένα μόνο τριαντάφυλλο λέει καλύτερα αυτό που θέλουμε να εκφράσουμε. Η Black Velvet Collection, μας θυμίζει ότι με το One of a Velvet, αυτό το ένα πρόσωπο κρύβει την δύναμη όλου του κόσμου και τις προοπτικές για το πλούσιο μπουκέτο.','ONE OF A VELVET | ETERNITY',NULL,'Sometimes one rose, says best what we wish to express. The Black Velvet Collection, reminds us that with One of a Velvet, this one person has all the power in the world to make our day, and all the potential to become the most stunning bouquet.',25,'one-of-a-velvet-eternity','63809.jpg',1,65,1,'2022-03-04','2022-03-04'),(1985,NULL,10,NULL,'NATURA A CASA - RED S',NULL,NULL,'Το χρυσό συμβολίζει τον πλούτο και την αφθονία. Δεν τελειώνουν ποτέ τα φύλλα ενός δέντρου, ή τα πέταλα ενός τριαντάφυλλου. Αφήστε αυτήν την αφθονία να σας συντροφεύει κάθε μέρα.\r\nΔείτε τον χώρο σας να μεταμορφώνεται με την εξαιρετική συλλογή της Fiorentino LFS, Natura a Casa και ζήστε μια μοναδική εμπειρία επαφής με τη φύση.','NATURA A CASA - RED S',NULL,'The red rose will always stay legendary, symbolizing passion and romance, as well as the absolute gift.\r\nWatch your space transform with this exceptional piece from the Natura a Casa Collection.',30,'natura-a-casa-red-s','96183.jpg',1,65,1,'2022-03-04','2022-03-04'),(1986,NULL,10,NULL,'Natura A Casa Gold Small',NULL,NULL,'Το χρυσό συμβολίζει τον πλούτο και την αφθονία. Δεν τελειώνουν ποτέ τα φύλλα ενός δέντρου, ή τα πέταλα ενός τριαντάφυλλου. Αφήστε αυτήν την αφθονία να σας συντροφεύει κάθε μέρα.\r\n\r\nΔείτε τον χώρο σας να μεταμορφώνεται με την εξαιρετική συλλογή της Fiorentino LFS, Natura a Casa και ζήστε μια μοναδική εμπειρία επαφής με τη φύση.','Natura A Casa Gold Small',NULL,'Gold refers to richness and abundance. The tree never runs out of leaves. The rose never runs our of petals. Let that blessing of abundance accompany your presence.\r\n\r\nWatch your space transform with this exceptional piece from the Natura a Casa by Fiorentino LFS and get in touch with nature.',35,'natura-a-casa-gold-small','62818.jpg',1,65,1,'2022-03-04','2022-03-04'),(1987,NULL,3,NULL,'CHIC & SIMPLE',NULL,NULL,'Για τον άνθρωπο που εντυπωσιάζει με την απλότητά του και είναι πάντα Chic & Simple. Σίγουρα, θα εντυπωσιαστεί με τις κίτρινες τουλίπες. Το πιο “σικ” μπουκέτο, μόλις το βρήκατε.','CHIC & SIMPLE',NULL,'For the one that impresses everyone with their simple nature, always being Chic & Simple. That person, will absolutely be impressed back, with this bouquet. You just found the most chic one. What a bouquet!',30,'chic-simple','24085.jpg',1,14,1,'2022-03-04','2022-03-04'),(1988,NULL,3,NULL,'SMALL BOUQUET, BIG LOVE',NULL,NULL,'Κάποιες φορές στα πιο μικρά πράγματα, κρύβονται τα πιο μεγάλα!\r\nΜπουκέτο με τριαντάφυλλα και τουλίπες.','SMALL BOUQUET, BIG LOVE',NULL,'Κάποιες φορές στα πιο μικρά πράγματα, κρύβονται τα πιο μεγάλα!\r\nΜπουκέτο με τριαντάφυλλα και τουλίπες.',35,'small-bouquet-big-love','75033.jpg',1,14,1,'2022-03-04','2022-03-04'),(1989,NULL,3,NULL,'RED PASSION',NULL,NULL,'Ένα μπουκέτο με σιωπηλή φινέτσα αλλά τόσο δυνατή προσωπικότητα. Με την αδιαπραγμάτευτη ομορφιά του κυριαρχεί στις επιλογές των πελατών μας.','RED PASSION',NULL,'A bouquet of silent, yet strong and bold finesse. It prevails in the heart’s of our customers, due to its non negotiable beauty and elegance.',50,'red-passion','15811.jpg',1,14,1,'2022-03-04','2022-03-04'),(1990,NULL,3,NULL,'LITTLE HEAVEN',NULL,NULL,'Φέρτε τον παράδεισο στο χώρο που επιθυμείτε.\r\n\r\nΤα χρώματα του σιελ και του λευκού, συνδυάζονται αρμονικά με το peach και τις συνοδευτικές πρασινάδες. Ο παράδεισος στην αγκαλιά της.','LITTLE HEAVEN',NULL,'Bring heaven, into your