ty.',90,'serendipity','4913.jpg',1,14,1,'2022-03-04','2022-03-04'),(1995,NULL,4,NULL,'PINK PARADISE',NULL,NULL,'Ποιό δώρο θα ήταν καλύτερη από μία πανέμορφη σύνθεση με ροζ λουλούδια; Bυθισμένη στο νερό, μέσα στο γυάλινο σωλήνα, η σύνθεση Pink Paradise σας κάνει να ονειρεύεστε ένα παραμυθένιο κόσμο με μαγευτικά χρώματα και όμορφη διάθεση! Καλωσήρθατε στην όασή σας…','PINK PARADISE',NULL,'Which gift could be better than a stunning arrangement of pink flowers? Dipped in water, in the glass tube, the Pink Paradise arrangement makes you dream of a fairytale land, with magical colours and a nice mood! Welcome to your oasis…',45,'pink-paradise','58225.jpg',1,14,1,'2022-03-04','2022-03-04'),(1996,NULL,4,NULL,'RED PARADISE',NULL,NULL,'Ο παράδεισος για τους περισσότερους, αποτελείται από πανέμορφα αλλά και απλά, κλασικά πράγματα. Οι κόκκινες τουλίπες είναι ικανές να δημιουργήσουν το οξύμωρο του κόκκινου παραδείσου! Με το εκρηκτικό τους χρώμα μας θυμίζουν τον έρωτα, αλλά με την κομψή τους εμφάνιση μας θυμίζουν την αγνότητα και την σιωπηλή γοητεία.','RED PARADISE',NULL,'Paradise is consisted of classic and simple things,,,stunning also. Red tulips are passionate and pure at the same time. Hence, “Red Paradise”.',40,'red-paradise','29118.jpg',1,14,1,'2022-03-04','2022-03-04'),(1997,NULL,4,NULL,'SWEET POT',NULL,NULL,'Μία “γλυκιά” πρόταση για τα αγαπημένα σας πρόσωπα.\r\n\r\nΣύνθεση σε λευκό κασπό με ροζ και lime αποχρώσεις.','SWEET POT',NULL,'What is sweetness? Some would say it is a state of being. We say it’s a floral arrangement of pink and lime colours.\r\n\r\nThis one will make your day.',40,'sweet-pot','8961.jpg',1,14,1,'2022-03-04','2022-03-04'),(1998,NULL,4,NULL,'BLOODY MOON',NULL,NULL,'Απάντησαμε στο λευκό, με κόκκινο, και ιδού το αποτέλεσμα!\r\n\r\nΑν είχε το φεγγάρι κόκκινα τριαντάφυλλα, κάπως έτσι θα έμοιαζε…','BLOODY MOON',NULL,'As if the moon got drunk on sangria…it looks like it is having a whole lot of fun!\r\n\r\nCheers to passionate feelings and magical nights t