οναδική εμπειρία επαφής με τη φύση.','NATURA A CASA - GOLD S',NULL,'Gold refers to richness and abundance. The tree never runs out of leaves. The rose never runs our of petals. Let that blessing of abundance accompany your presence.\r\n\r\nWatch your space transform with this exceptional piece from the Natura a Casa by Fiorentino LFS and get in touch with nature.',35,'natura-a-casa-gold-s','94042.jpg',1,14,1,'2022-03-04','2022-03-04'),(2003,NULL,10,NULL,'NATURA A CASA - RED S',NULL,NULL,'Το κόκκινο τριαντάφυλλο δεν θα πάψει να είναι ιδανική επιλογή.\r\n\r\nΣυμβολίζει το πάθος, τον έρωτα και αποτελεί το απόλυτο δώρο.\r\n\r\nΔείτε τον χώρο σας να μεταμορφώνεται με την εξαιρετική συλλογή της Fiorentino LFS, Natura a Casa και ζήστε μια μοναδική εμπειρία επαφής με τη φύση.','NATURA A CASA - RED S',NULL,'The red rose will always stay legendary, symbolizing passion and romance, as well as the absolute gift.\r\n\r\nWatch your space transform with this exceptional piece from the Natura a Casa Collection.',30,'natura-a-casa-red-s','80987.jpg',1,14,1,'2022-03-04','2022-03-04'),(2004,NULL,10,NULL,'LOVE | ETERNITY',NULL,NULL,'Η πραγματική αγάπη, κρατάει για πάντα. Οι εποχές θα περνάνε και αυτή θα παραμένει άθικτη στις αλλαγές, κάθε μέρα όλο και πιο όμορφη και πιο δυνατή. Σαν τα τριαντάφυλλα που θα της προσφέρετε.','LOVE | ETERNITY',NULL,'True love is forever. Seasons change, but love remains unaffected, stronger and prettier every day. Like the roses you may offer her.',100,'love-eternity','17703.jpg',1,14,1,'2022-03-04','2022-03-04'),(2005,NULL,10,NULL,'GOLD BEAUTY',NULL,NULL,'Το τέλειο δώρο για τον άνθρωπο που σας κάνει να νιώθετε βασιλιάς του κόσμου.\r\n\r\nΟ πιο γοητευτικός και επιβλητικός συνδυασμός χρωμάτων. Ένας συνδυασμός που συμβολίζει την εξοχότητα και την μεγαλοπρέπεια.','GOLD BEAUTY',NULL,'If someone makes you feel like the king of the world, this is for them.\r\n\r\nThe most charming and powerful colour combination. It symbolises majesty, royalty and magnificence.',