ε τον ένα και μοναδικό άνθρωπο σας, οφείλει να το ξέρει.','THE ONE & ONLY',NULL,'If you found the one, make sure to tell them.\r\n\r\nIn a sea of perfect rose fields, you must pick the perfect one for you.',15,'the-one-only','39001.jpg',1,14,1,'2022-03-04','2022-03-04'),(2010,NULL,8,NULL,'ΑΝΘΟΥΡΙΟ',NULL,NULL,'Το Ανθούριο, είναι ένα εντυπωσιακό φυτό εσωτερικού χώρου, με κόκκινα άνθη σε σχήμα καρδιάς. Ένα υπέροχο φυτό για να διακοσμήσετε το προσωπικό ή επαγγελματικό σας χώρο.','ΑΝΘΟΥΡΙΟ',NULL,'Anthurium, is an impressive indoor plant with red heart-shaped flowers. A wonderful plant to decorate your personal or professional space with.',45,'anthoyrio','6790.jpg',1,65,1,'2022-03-04','2022-03-04'),(2011,NULL,8,NULL,'ZAMIOCULCAS PREMIUM',NULL,NULL,'Η ζάμια είναι το κατάλληλο φυτό για αυτούς που δεν διαθέτουν χρόνο για φροντίδα. Όσες ώρες κι αν λείπετε από το σπίτι, η ζάμια θα σας υποδέχεται με την ομορφιά της, τα βαθιά πράσινα φύλλα της και τον τρόπο που αντανακλούν το φως σε όλο το χώρο. Το φυτό zamioculcas premium είναι το ιδανικό δώρο για εκείνο τον φίλο που παραπονιέται ότι δεν έχει χρόνο!','ZAMIOCULCAS PREMIUM',NULL,'Zamioculcas is the absolute best plant for the ones who have no time for proper plant care. As many hours as you are away from home, when you get back, zamioculcas will welcome you with its beauty, its dark green leaves and the way they reflect the light around the room. Zamioculcas Premium is the ideal gift for you or that friend that always complains they have no time.',60,'zamioculcas-premium','42285.jpg',1,65,1,'2022-03-04','2022-03-04'),(2012,NULL,8,NULL,'ΣΑΝΣΕΒΙΕΡΙΑ PREMIUM',NULL,NULL,'Η σανσεβιέρια είναι ένα φυτό με προσωπικότητα. Το πιο ανεξάρτητο ως προς την φροντίδα του. Το χαρακτηριστικό και γοητευτικό ως προς την εμφάνιση του. Η ιδιαιτερότητα των φύλλων του συγκλονίζει και το καθιστά, ίσως το πιο όμορφο φυτό εσωτερικού χώρου.','SANSEVIERIA PREMIUM',NULL,'The sansevieria is a plant with a rich personality. The most independent in its care. The most particular and charming one, in its looks. Its strangely magnificent leaves are an attention magnet and make it probably the prettiest indoor plant.',100,'sansebieria-premium','79797.jpg',1,65,1,'2022-03-04','2022-03-04'),(2013,NULL,8,NULL,'ΟΡΧΙΔΕΑ PHALENOPSIS',NULL,NULL,'Το φυτό που είναι πανταχού παρόν και δεν μας κάνει εντύπωση. Αφού η γοητεία του, εκτιμάται από όλους. Η καταπληκτική ορχιδέα είναι μία διαχρονική και πάντα σοφή επιλογή για την διακόσμηση ενός εσωτερικού χώρου. Συμβολίζει την πολυτέλεια, την ομορφιά και την αγνότητα. Από την αρχαία Ελλάδα έως και σήμερα, αυτό το φυτό αγαπήθηκε σε όλο τον κόσμο. Χαρίστε ένα δώρο κομψότητας που ταιριάζει σε όλες τις περιστάσεις.','ORCHID PHALENOPSIS',NULL,'The well deserved ubiquitous plant. How could everyone not love it?\r\n\r\nIts elegance is appreciated by every one of us. The extraordinary orchid is a timeless and always perfect choice for decorating a space. It symbolizes luxury, beauty and love. From ancient Greece to today, it has been adored throughout the world. Offer this gift of charm to your loved ones, as it is fit to any occasion.',45,'orxidea-phalenopsis','47283.jpg',1,65,1,'2022-03-04','2022-03-04'),(2014,NULL,3,NULL,'BIG SURPRISE',NULL,NULL,'Ποτέ μην αφισβητείτε την δύναμη μίας έκπληξης! Το απροσδόκητο, η έκρηξη συναισθημάτων και η αλλαγή της διάθεσης μας, δεν θα παλιώσει ποτέ. Να, ένα πανέμορφο μπουκέτο, έτοιμο να κάνει τον παραλήπτη του να χαμογελάσει.','BIG SURPRISE',NULL,'The power of a bouquet surprise, could never be doubted. The unexpected explosion of feelings and the immediate shift of our mood, could never get old. So, here is a stunning bouquet,ready to make its receiver, smile.',40,'big-surprise','999.jpg',1,65,1,'2022-03-04','2022-03-04'),(2015,NULL,3,NULL,'Μπουκέτο με 11 τουλίπες, κούμαρο, ασπάραγκος, ευκάλυπτος',NULL,NULL,'','Bouquet of 11 toulips, koumaro, asparagkus',NULL,'',35,'mpoyketo-me-11-toylipes-koymaro-asparagkos-eykalyptos','63811.png',1,25,1,'2022-03-04','2022-03-04'