NULL,8,NULL,'Γκουσμάνια σε Φυσικό Κορμό Ακακίας',NULL,NULL,'Λατινική ονομασία:  Guzmania rana\r\nΟικογένεια: Bromeliaceae\r\n\r\nΕξαίρετη επιλογή για τη διακόσμηση του σπιτιού ή του γραφείου μας! Προτείνεται για κάθε είδους περίσταση, όπως γενέθλια, γιορτή, επίσκεψη, εγκαίνια, ή επαγγελματικό δώρο.','Guzmania - Wood',NULL,'',42,'gkoysmania-se-fysiko-kormo-akakias','8995.jpeg',1,52,1,'2022-04-19','2022-04-19'),(2214,NULL,8,NULL,'Σανσεβιέρια σε Φυσικό Κορμό Ακακίας',NULL,NULL,'Λατινική ονομασία: Sansevieria trifasciata\r\nΟικογένεια: Asparagaceae\r\n\r\nΠανέμορφο, κομψό και φίνο! Διακοσμήστε το σπίτι, τη βεράντα ή το γραφείο σας! Κατάλληλο για κάθε είδους περίσταση, όπως γενέθλια, γιορτή, επίσκεψη, εγκαίνια, ή επαγγελματικό δώρο. Η σανσεβιέρια είναι ένα μοναδικό φυτό όπου κατά την διάρκεια της νύχτας, παράγει οξυγόνο και απορροφά το διοξείδιο του άνθρακα.','Sansevieria – Wood',NULL,'',50,'sansebieria-se-fysiko-kormo-akakias','46244.jpeg',1,52,1,'2022-04-19','2022-04-19'),(2215,NULL,8,NULL,'Σενέκιο',NULL,NULL,'Οικογένεια: Asteraceae\r\nΛατινική Ονομασία: Senecio rowleyanus','Senecio',NULL,'',35,'senekio','455.jpeg',1,52,1,'2022-04-19','2022-04-19'),(2216,NULL,8,NULL,'Τιλάνσια σε Φυσικό Κορμό Ακακίας',NULL,NULL,'Λατινική ονομασία: Tillandsia cyanea\r\nΟικογένεια: Bromeliaceae\r\n\r\nΔύο λουλούδια και δύο χρώματα σε ένα φυτό! Πανέμορφη επιλογή σε όμορφο και ρομαντικό χρώμα!','Tillandsia - Wood',NULL,'',45,'tilansia-se-fysiko-kormo-akakias','96705.jpeg',1,52,1,'2022-04-19','2022-04-19'),(2217,NULL,8,NULL,'Σύνθεση με Κακτάκια',NULL,NULL,'Σύνθεση με 3 Κακτάκια σε Πήλινο Ποτ','Colourful Cacti',NULL,'',35,'synthesh-me-kaktakia','78210.jpeg',1,52,1,'2022-04-19','2022-04-19'),(2218,NULL,8,NULL,'Ρίψαλις',NULL,NULL,'Οικογένεια: Cactaceae\r\nΛατινική Ονομασία: Rhipsalis baccifera','Rhipsalis baccifera',NULL,'',35,'ripsalis','91366.jpeg',1,52,1,'2022-04-19','2022-04-19'),(2219,NULL,8,NULL,'Αίχμεα',NULL,NULL,'Λατινική ονομασία: Aechmea fasciata\r\nΟικογένεια: Bromeliaceae\r\n\r\nΕξα